INSERT INTO `products` VALUES (1,'1903200480','볼링 게임 (53009085)',12000,2500,120,'모두가 함꼐 즐길 수 있는\n휴대용 볼링게임을 소개합니다.\n\n간편하게 설치할 수 있어 \n언제 어디서든지 볼링게임을 즐길 수 있어요.\n\n귀여운 갈라파고스 친구들과 함께 \n재미있는 볼링게임을 즐겨보세요!\n','2019-03-29 20:02:22','2019-03-29 20:02:22',NULL,1),(2,'1903080417','일반쿠션 아이렌 납작 (34009678)',8500,2500,85,'안고있으면 마음이 편안해지는 납작한 아이렌 쿠션입니다.\n뽀송뽀송한 원단으로 만들어져서 만질수록 더 애착이 갑니다.\n혼자서도 앉을 수 있도록 만들어졌습니다.\n선물하기에도 좋고, 침실이나 거실에 두기에도 좋은 쿠션입니다.\n','2019-03-29 20:02:22','2019-03-29 20:02:22',NULL,2),(3,'1903200482','컬링 게임 (53009086)',12000,2500,120,'모두가 함꼐 즐길 수 있는\n휴대용 컬링게임을 소개합니다.\n\n간편하게 설치할 수 있어 \n언제 어디서든지 컬링게임을 즐길 수 있어요.\n\n귀여운 갈라파고스 친구들과 함께 \n재미있는 컬링게임을 즐겨보세요!\n','2019-03-29 20:02:22','2019-03-29 20:02:22',NULL,1),(4,'1902140312','키링 후드쓴아이렌 (34009673)',8500,2500,85,'예쁜 노란빛의 지프렌즈<아이렌> 인형입니다.\n분홍색 후드를 뒤집어 쓰고있어 더욱 귀여워보입니다.\n인형 머리 상단에 은색의 가방고리가 달려있어서 가방에 달고다닐 수 있습니다.\n서있는 모양의 인형으로 책상이나 선반 등 인테리어 소품으로 사용할 수 있습니다.\n친구제품으로 지프렌즈 <올리버>, <보스>, <말리>가 있습니다.','2019-03-29 20:02:22','2019-03-29 20:02:22',NULL,3),(5,'1902150331','옷핀인형뱃지 아이렌 대 (34009657)',5800,2500,58,'하트를 양손으로 꼬옥 끌어안은 모습이 사랑스러운 아이렌 뱃지 인형입니다.\n상단에 고리, 뒷면에 옷핀이 달려있어 옷, 가방 등에 다양하게 달고 다닐 수 있어요.\n전체적으로 납작한 형태로 제작되어 옷핀으로 고정 시 좀 더 안정감 있게 달 수 있어요~!','2019-03-29 20:02:22','2019-03-29 20:02:22',NULL,3),(6,'1903080420','일반쿠션 올리버 납작 (34009679)',8500,2500,85,'안고있으면 마음이 편안해지는 납작한 아이렌 쿠션입니다.\n뽀송뽀송한 원단으로 만들어져서 만질수록 더 애착이 갑니다.\n혼자서도 앉을 수 있도록 만들어졌습니다.\n선물하기에도 좋고, 침실이나 거실에 두기에도 좋은 쿠션입니다.','2019-03-29 20:02:22','2019-03-29 20:02:22',NULL,2),(7,'1902150038','일반쿠션 엎드린올리버 중 (34009666)',15000,2500,150,'동그란 눈과 앙증맞은 입을 가진 <올리버>쿠션입니다.\n고개를 옆으로 돌리고 엎드려있는 중형사이즈의 귀여운 쿠션입니다. \n부드럽고 말랑말랑한 소재로 안았을 때 폭신폭신하고 기분이 좋아집니다.\n','2019-03-29 20:02:22','2019-03-29 20:02:22',NULL,2),(8,'1903140225','쿠션 대형 엎드린 그레이시바 (34009774)',9900,2500,99,'그레이 색상의 엎드린 시바견 인형입니다.\n보들보들하고 쫀득한 원단으로 제작해 촉감이 좋습니다.	\n한번 만지면 멈출 수 없는 중독적인 촉감이 시바견에게 푹 빠지게된답니다~\n안고있으면 포근해지는 편안한그립감과 말랑한 모찌촉감으로 쿠션,베개로도 안성맞춤입니다!','2019-03-29 20:02:22','2019-03-29 20:02:22',NULL,2),(9,'1903080572','술게임 젠가 (53008818)',9900,2500,99,'마셔라 마셔라 마셔라 마셔라~ 술이 들어간다! 쭉쭉쭉!\n짜릿짜릿! 술자리를 더 즐겁게 만드는 취중젠가를 소개해요!\n재미있는 벌칙이 더해진 젠가 게임으로 술자리의 분위기를 띄어보세요.\n취중젠가 안에는 \"오른쪽 사람 마시기\", \"1분간 춤추기\", \"안주 하나 사기\" 등의 재밌는 미션이 \n총 18개가 들어있어요.\n젠가 특성상 게임 방식이 쉽고 간단하기 때문에 누구나 참여할 수 있어요.\n\n취중젠가와 함께 더욱 더 신나는 술자리를 완성해보세요!','2019-03-29 20:02:22','2019-03-29 20:02:22',NULL,1),(10,'1902140435','키링후드쓴말리 (34009674)',8500,2500,85,'예쁜 하얀색의 지프렌즈<말리> 인형입니다.\n노란색 후드를 뒤집어 쓰고있어 더욱 귀여워보입니다.\n인형 머리 상단에 은색의 가방고리가 달려있어서 가방에 달고다닐 수 있습니다.\n서있는 모양의 인형으로 책상이나 선반 등 인테리어 소품으로 사용할 수 있습니다.\n친구제품으로 지프렌즈 <올리버>, <보스>, <아이렌>이 있습니다.\n','2019-03-29 20:02:22','2019-03-29 20:02:22',NULL,3),(11,'1902150056','일반쿠션 엎드린보스 대 (34009671)',23000,2500,230,'대형 엎드린 <보스> 쿠션을 소개합니다!\n<보스>는 좌충우돌 사고뭉치지만 갈라파고스의 보스를 자칭하는 의리있는 캐릭터입니다.\n상어의 실루엣이 살아있어 편하게 안고 있을 수 있습니다.\n큰 사이즈로 베고 눕거나 껴안고 자기에 편안합니다.\n부드럽고 말랑말랑한 소재로 안았을 때 폭신폭신하고 기분이 좋아집니다.\n','2019-03-29 20:02:22','2019-03-29 20:02:22',NULL,2),(12,'1902150039','일반쿠션 엎드린아이렌 중 (34009667)',15000,2500,150,'앙증맞은 주황색 부리와 작은 몸집의 <아이렌> 쿠션입니다.\n고개를 옆으로 돌리고 엎드려있는 중형사이즈의 귀여운 쿠션입니다. \n부드럽고 말랑말랑한 소재로 안았을 때 폭신폭신하고 기분이 좋아집니다.\n','2019-03-29 20:02:22','2019-03-29 20:02:22',NULL,2),(13,'1903140556','플레잉카드 플라스틱 강남스 컬러 (26016317)',5800,2500,58,'귀여운 강남스 일러스트가 그려진 플라스틱 재질의 플레잉 카드입니다.','2019-03-29 20:02:22','2019-03-29 20:02:22',NULL,1),(14,'1903140163','일반쿠션 앉은 머리큰아이렌 (34009637)',8900,2500,89,'머리가 커진 귀여운 아이렌 인형입니다\n멍한 눈과 큰부리가 포인트 입니다.\n보들보들한 소재의 원단으로 안았을때 기분이 좋아진답니다~\n친구제품으로 시바견, 미토가있습니다.	','2019-03-29 20:02:22','2019-03-29 20:02:22',NULL,2),(15,'1903140172','일반쿠션 앉은 아이럽미토 (34009638)',8500,2500,85,'익살맞은 표정으로 보고있으면 기분이 좋아지는 미토인형입니다.\n어디서나 앉힐수있어 테이블이나 선반위에 올려놓고 밝은 미소를 감상하세요\n뽀송뽀송 보들보들한 소재의 원단으로 안았을때 기분이 좋아진답니다~\n친구제품으로 시바견, 아이렌이 있습니다.	\n','2019-03-29 20:02:22','2019-03-29 20:02:22',NULL,2),(16,'1903080470','플레잉카드 플라스틱갈라 컬러 (26016315)',5800,2500,58,'귀여운 갈라파고스 프렌즈 일러스트가 그려진 플라스틱 재질의 플레잉 카드입니다.','2019-03-29 20:02:22','2019-03-29 20:02:22',NULL,1),(17,'1902150046','일반쿠션 엎드린아이렌 대 (34009669)',23000,2500,230,'대형 엎드린 <아이렌> 쿠션을 소개합니다!\n<아이렌>은 마성의 노래로 상대방을 치유하는 능력을 지닌 캐릭터 입니다.\n큰 사이즈로 베고 눕거나 껴안고 자기에 편안합니다.\n부드럽고 말랑말랑한 소재로 안았을 때 폭신폭신하고 기분이 좋아집니다.\n','2019-03-29 20:02:22','2019-03-29 20:02:22',NULL,2),(18,'1903080468','플레잉카드 페이퍼갈라 컬러 (26016314)',3800,2500,38,'귀여운 갈라파고스 프렌즈 일러스트가 그려진 코팅 종이 플레잉 카드입니다.','2019-03-29 20:02:22','2019-03-29 20:02:22',NULL,1),(19,'1903140554','플레잉카드 페이퍼 강남스 컬러 (26016316)',3800,2500,38,'귀여운 강남스 일러스트가 그려진 코팅 종이 플레잉 카드입니다.','2019-03-29 20:02:22','2019-03-29 20:02:22',NULL,1),(20,'1902150340','미니 슬롯머신 저금통 (53008614)',14900,2500,149,'재미있는 게임을 즐기며 저금통으로 사용할 수 있는\n미니 슬롯머신 저금통을 소개합니다.\n\n뒷면에 저금통에 동전을 저금할 수 있으며\n건전지로 언제 어디서든지 간편하게 즐길 수 있어요.\n\n톡톡 튀는 그래픽으로\n게임하는 즐거움이 두배!\n\n미니 슬롯머신과 함께 즐거운 하루 보내세요!','2019-03-29 20:02:22','2019-03-29 20:02:22',NULL,1),(21,'1902150043','일반쿠션 엎드린올리버 대 (34009668)',23000,2500,230,'대형 엎드린 <올리버> 쿠션을 소개합니다!\n<올리버>는 위로를 잘 해주는 캐릭터입니다.\n큰 사이즈로 베고 눕거나 껴안고 자기에 편안합니다.\n부드럽고 말랑말랑한 소재로 안았을 때 폭신폭신하고 기분이 좋아집니다.','2019-03-29 20:02:22','2019-03-29 20:02:22',NULL,2),(22,'1902140437','키링 후드쓴보스 (34009675)',8500,2500,85,'예쁜 푸른빛의 지프렌즈<보스> 인형입니다.\n네이비 후드를 뒤집어 쓰고있어 더욱 귀여워보입니다.\n인형 머리 상단에 은색의 가방고리가 달려있어서 가방에 달고다닐 수 있습니다.\n서있는 모양의 인형으로 책상이나 선반 등 인테리어 소품으로 사용할 수 있습니다.\n친구제품으로 지프렌즈 <올리버>, <말리>, <아이렌>이 있습니다.\n','2019-03-29 20:02:22','2019-03-29 20:02:22',NULL,3),(23,'1902150212','옷핀인형뱃지 보스 대 (34009654)',5800,2500,58,'물고기를 꼬옥 껴안고 해맑게 웃는 모습이 귀여운 G.보스 뱃지 인형입니다.\n상단에 고리, 뒷면에 옷핀이 달려있어 옷, 가방 등에 다양하게 달고 다닐 수 있어요.\n전체적으로 납작한 형태로 제작되어 옷핀으로 고정 시 좀 더 안정감 있게 달 수 있어요~!\n','2019-03-29 20:02:22','2019-03-29 20:02:22',NULL,3),(24,'1903080410','일반쿠션 시바 납작 (34009677)',8500,2500,85,'안고있으면 마음이 편안해지는 납작한 시바쿠션입니다.\n뽀송뽀송한 원단으로 만들어져서 만질수록 더 애착이 갑니다.\n혼자서도 앉을 수 있도록 만들어졌습니다.\n선물하기에도 좋고, 침실이나 거실에 두기에도 좋은 쿠션입니다.\n','2019-03-29 20:02:22','2019-03-29 20:02:22',NULL,2),(25,'1902140293','키링 엎드린토끼 소 (34009665)',6800,2500,68,'여리여리한 분홍색 컬러의 <토끼> 인형입니다.\n인형 머리 상단에 금빛의 가방고리가 달려있어서 가방에 달고다닐 수 있습니다.\n엎드려있는 모양의 인형으로 책상이나 선반 등 인테리어 소품으로 사용할 수 있습니다.\n가방고리에 함께 달려있는 당근이  <토끼> 를 더욱 돋보이게 합니다.\n친구제품으로 지프렌즈 <올리버>, <아이렌>, <보스>가 있습니다.','2019-03-29 20:02:22','2019-03-29 20:02:22',NULL,3),(26,'1902140310','키링 후드쓴올리버 (34009672)',8500,2500,85,'예쁜 주황색 컬러의 지프렌즈<올리버> 인형입니다.\n민트색 후드를 뒤집어 쓰고있어 더욱 귀여워보입니다.\n인형 머리 상단에 은색의 가방고리가 달려있어서 가방에 달고다닐 수 있습니다.\n서있는 모양의 인형으로 책상이나 선반 등 인테리어 소품으로 사용할 수 있습니다.\n친구제품으로 지프렌즈 <아이렌>, <보스>, <말리>가 있습니다.','2019-03-29 20:02:22','2019-03-29 20:02:22',NULL,3),(27,'1902150246','옷핀인형뱃지 오토 대 (34009655)',5800,2500,58,'물고기를 꼬옥 껴안고 있는 귀여운 모습의 오토 뱃지 인형입니다.\n상단에 고리, 뒷면에 옷핀이 달려있어 옷, 가방 등에 다양하게 달고 다닐 수 있어요.\n전체적으로 납작한 형태로 제작되어 옷핀으로 고정 시 좀 더 안정감 있게 달 수 있어요~!','2019-03-29 20:02:22','2019-03-29 20:02:22',NULL,3),(28,'1902150013','쿠션 얼룩강아지 길쭉 (34009364)',19900,2500,199,'엎드린 얼룩 강아지 쿠션을 소개합니다!\n길쭉하게 엎드려 있는 형태라 눕거나 껴안고 자기에 편안합니다.\n부드럽고 말랑말랑한 소재로 안았을 때 폭신폭신하고 기분이 좋아집니다.\n발에는 귀여운 발바닥 자수가 박혀 있습니다.','2019-03-29 20:02:22','2019-03-29 20:02:22',NULL,2),(29,'1903080473','플레잉카드 플라스틱 보스 (26016318)',5800,2500,58,'귀여운 갈라파고스 프렌즈의 보스 캐릭터 일러스트가 그려진 플라스틱 재질의 플레잉 카드입니다.','2019-03-29 20:02:22','2019-03-29 20:02:22',NULL,1),(30,'1902150321','옷핀인형뱃지 브라운시바 대 (34009656)',5800,2500,58,'하트를 양손으로 꼬옥 끌어안은 모습이 사랑스러운 브라운 시바 뱃지 인형입니다.\n상단에 고리, 뒷면에 옷핀이 달려있어 옷, 가방 등에 다양하게 달고 다닐 수 있어요.\n전체적으로 납작한 형태로 제작되어 옷핀으로 고정 시 좀 더 안정감 있게 달 수 있어요~!\n','2019-03-29 20:02:22','2019-03-29 20:02:22',NULL,3),(31,'1903140207','일반쿠션 앉은 시바견 (34009639)',8900,2500,89,'짧은 팔다리가 매력적인 시바견 인형입니다\n어디서나 앉힐수있어 테이블이나 선반위에 올려놓고 함께하세요\n보들보들한 소재의 원단으로 안았을때 기분이 좋아진답니다~\n친구제품으로 미토, 아이렌이 있습니다.	\n','2019-03-29 20:02:22','2019-03-29 20:02:22',NULL,2),(32,'1902150053','일반쿠션 엎드린오토 대 (34009670)',23000,2500,230,'대형 엎드린 <오토> 쿠션을 소개합니다!\n-<오토>는 순수하고 어린아이같은 행동을 하지만 심오한 사고력을 가진 해달친구입니다.\n큰 사이즈로 베고 눕거나 껴안고 자기에 편안합니다.\n부드럽고 말랑말랑한 소재로 안았을 때 폭신폭신하고 기분이 좋아집니다.\n','2019-03-29 20:02:22','2019-03-29 20:02:22',NULL,2),(33,'1812270546','강아지 애착인형 바비큐 (26016820)',2000,2500,20,'바비큐 모양의 애착인형이예요. 인형을 꾹 누르면 삑-소리가 나요.\n귀여운 애착인형으로 강아지들의 불안감 감소와 정서적 안정감에 도움을 주세요.\n','2019-03-29 20:02:47','2019-03-29 20:02:47',NULL,1),(34,'1902140289','키링 엎드린아이렌 소 (34009663)',6800,2500,68,'여리여리한 노란색 컬러의 지프렌즈 <아이렌> 인형입니다.\