에 인덱스가 있어서 공책이나 책 사이에 끼워 쓰거나 책갈피 등으로 활용 할 수 있어요.\n넉넉한 50매로 구성되어 있어서 부담없이 쓰기 좋아요.\n간단한 메시지를 전하고 싶을 때, 잊기 쉬운 일정을 눈에 띄는 곳에 부착할 때,\n귀여운 멍뭉이 인덱스 점착메모지와 함께하세요!\n','2019-03-29 20:08:07','2019-03-29 20:08:07',NULL,22),(468,'1901160775','쇼핑백 핵인싸템 문구 (소) (07004271)',1500,2500,15,'강렬한 카피가 들어간 쇼핑백이에요. 재질이 튼튼해 가득 담은 물건도 거뜬해요.\n무엇을 담아도 ‘핵인싸템’이 되는 매직! 평범한 선물도 센스있게 포장해드려요.\n','2019-03-29 20:08:07','2019-03-29 20:08:07',NULL,12),(469,'1901300532','블루단어장 미니(무선) (04009337)',1000,2500,10,'한손에 쏙 들어오는 미니 단어장입니다. 120매로 넉넉하게 사용할 수 있어요.\n내지는 무지로 되어있어 원하는 형식으로 단어장을 만들 수 있습니다. \n링 고리가 들어있어 페이지를 넘기기 편하고, 필요한 만큼 내지를 추가하거나 빼서 가지고 다닐 수 있어요.','2019-03-29 20:08:07','2019-03-29 20:08:07',NULL,11),(470,'1901300648','점착메모지 오토조개 허그점착 (04009352)',1200,2500,12,'오토가 선물을 쏙 품고있는 귀여운 허그 점착 메모지에요.\n접지선을 따라 양쪽 팔을 다 접으면 포옹을 하고 있는 모습이 됩니다.\n간단한 약속을 정할 때나, 메시지를 전달할 때 특히 좋은 허그 메모지!\n특별한 메모지를 원하신다면 바로 이 허그 메모지를 선택해 보세요.','2019-03-29 20:08:07','2019-03-29 20:08:07',NULL,22),(471,'1901310498','점착메모지 보스 인덱스 (04009412)',1200,2500,12,'어디에 붙여도 귀여운 보스가 그려진 점착메모지에요.\n오른쪽에 인덱스가 있어서 공책이나 책 사이에 끼워 쓰거나 책갈피 등으로 활용 할 수 있어요.\n넉넉한 50매로 구성되어 있어서 부담없이 쓰기 좋아요.\n간단한 메시지를 전하고 싶을 때, 잊기 쉬운 일정을 눈에 띄는 곳에 부착할 때,\n귀여운 인덱스 점착메모지와 함께하세요!\n','2019-03-29 20:08:07','2019-03-29 20:08:07',NULL,22),(472,'1901240415','노트 하트그라데이션 pp커버 스프링 (03007884)',3500,2500,35,'','2019-03-29 20:08:07','2019-03-29 20:08:07',NULL,11),(473,'1901300514','핑크단어장 미니(무선) 2권세트 (04009336)',1100,2500,11,'한손에 쏙 들어오는 미니 단어장 세트입니다. 60매 2권 세트 구성으로 넉넉하게 사용할 수 있어요.\n내지는 무지로 되어있어 원하는 형식으로 단어장을 만들 수 있습니다. \n링 고리가 들어있어 페이지를 넘기기 편하고, 필요한 만큼 내지를 추가하거나 빼서 가지고 다닐 수 있어요.','2019-03-29 20:08:07','2019-03-29 20:08:07',NULL,11),(474,'1901300594','점착메모지 멍뭉 절취인덱스 (04009345)',2000,2500,20,'절취선이 있어 뜯어서 사용할 수 있는 점착메모지입니다. \n빈칸에 메모를 해서 붙이거나 인덱스로도 활용 가능합니다.\n떼어낸 부분을 중요한 내용을 표시하는 포인트 인덱스로도 사용할 수 있어 유용해요. 공부를 할 때나 스케줄러에 계획을 적을 때 귀여운 멍뭉이 절취인덱스를 붙여보세요.        \n','2019-03-29 20:08:07','2019-03-29 20:08:07',NULL,22),(475,'1901240399','노트 모자쓴보스 돔송 무선철 (40매) (03007876)',1500,2500,15,'보기만 해도 즐거워 지는 귀여운 보스가 하