 고급스러운 B4 드로잉 스프링노트에 자유롭게 나만의 그림을 담아보세요. \n','2019-03-29 20:08:07','2019-03-29 20:08:07',NULL,11),(484,'1901300669','점착메모지 한글 인덱스미니 (04009411)',2500,2500,25,'인덱스로 활용할 수 있는 미니 점착메모지입니다. 필통이나 가방에 쏙 들어가는 포켓 사이즈에요!\n차분한 느낌의 한글 카피가 쓰여진 6가지 디자인이 20매씩 들어있습니다. 메모지 겸 인덱스로 필요에 따라 활용하세요!\n','2019-03-29 20:08:07','2019-03-29 20:08:07',NULL,22),(485,'1901160778','파일 벚꽃 스프링클리어 40P (05001297)',5000,2500,50,'잘 펴지는 스프링 노트형 파일이 출시되었어요. 핑크 바탕에 여리여리한 벚꽃 패턴으로 설레는 봄의 느낌 가득해요.\n총 40매 내지가 들어있는 벚꽃 스프링 파일에 나의 소중한 문서들을 보관해보세요.\n','2019-03-29 20:08:07','2019-03-29 20:08:07',NULL,23),(486,'1901300553','점착메모지 연필 절취인덱스 (04009344)',2000,2500,20,'절취선이 있어 뜯어서 사용할 수 있는 점착메모지입니다. 빈칸에 메모를 해서 붙이거나 인덱스로도 활용 가능합니다.\n떼어낸 부분을 중요한 내용을 표시하는 포인트 인덱스로도 사용할 수 있어 유용해요. \n공부를 할 때나 스케줄러에 계획을 적을 때 절취인덱스를 붙여보세요.','2019-03-29 20:08:07','2019-03-29 20:08:07',NULL,22),(487,'1901160794','캐쉬북 핑크멍뭉 월간가계부 스케쥴러형 (04009340)',3800,2500,38,'멍뭉이 일러스트가 그려진 심플한 핑크색 표지의 6개월 가계부예요. 월간 소비계획, 주간 소비계획, 각종 목록과 통장관리, 노트로 구성되어있어요.\n심플한 한글 폰트에 시원한 레이아웃으로 쉽게 쓸 수 있는 가계부랍니다. 한 달의 수입, 지출 계획을 꼼꼼히 세워 합리적인 소비습관을 길러보세요!\n','2019-03-29 20:08:07','2019-03-29 20:08:07',NULL,18),(488,'1901240312','노트 그린카피 A5 상철드로잉 스프링 (03007867)',3200,2500,32,'휴대하기 편리한 A5 사이즈 드로잉 노트를 어디든 가지고 다니며 하루 한장씩 그림을 그려보세요.\n상철 스프링 제본으로 넘겨쓰기 편리합니다. 뒤표지는 DG1000g/m2로 그림을 그릴때 탄탄하게 받쳐줍니다.\n한 장씩 뜯어 쓸 수 있고 드로잉 하기 좋은 도화지 170g/m2 용지 60매로 넉넉하게 쓸 수 있습니다.','2019-03-29 20:08:07','2019-03-29 20:08:07',NULL,11),(489,'1901160777','쇼핑백 받아죠스 문구 (소) (07004270)',1500,2500,15,'강렬한 문구에 귀여운 죠스가 들어간 쇼핑백이에요. 재질이 튼튼해 가득 담은 물건도 거뜬해요.\n선물을 담으면 더욱 애교 넘치는 카피! 받아주었으면 하는 마음을 위트있게 전하세요.\n','2019-03-29 20:08:07','2019-03-29 20:08:07',NULL,12),(490,'1901240396','노트 책쓴오토 돔송 무선철 (40매) (03007875)',1500,2500,15,'보기만 해도 즐거워 지는 귀여운 오토가 머리위에 책을 올리고 있는 그래픽의 노트에요!\n활용도 높은 적당한 사이즈에 필기가 편안한 8mm간격의 줄노트입니다.\n40매의 내지로 넉넉하게 사용할 수 있어요..\n과목노트나 각종 필기용, 또는 일기장 등으로 활용하기도 좋습니다.\n','2019-03-29 20:08:07','2019-03-29 20:08:07',NULL,11),(491,'1901240412','노트 보스 pp커버 스프링 (03007883)',3500,2500,35,'','2019-03-29 20:08:07','2019-03-29 20:0