270108','오토 올리버 묶음노트(유선) (03007759)',2000,2500,20,'귀여운 오토와 올리버 패턴의 예쁜 노트 두권 세트가 특가로 출시되었어요! 내지 48매로 구성된 두께감있는 실용적인 라인 노트예요.\n핑크바탕에 하늘빛 오토 패턴, 블루바탕에  갈색 올리버 패턴. 우열을 가리기 힘든 귀여운 디자인에 착한 가격까지 더한 노트 세트, 꼭 소장하세요!\n','2019-03-29 20:13:10','2019-03-29 20:13:10',NULL,11),(721,'1806251260','노트심플크라프트스크랩(03007781)',2500,2500,25,'내추럴한 크라프트 표지, 내지로 구성된 심플한 스크랩 노트예요.\n넘기기 편한 PUR제본에 먹박 인쇄된 표지가 고급스러워요. 사진을 붙이고\n글을 덧붙여 소중한 추억을 담아보세요.\n나만의 이야기를 담는 노트로 활용해도 좋은 핸디한 사이즈랍니다.','2019-03-29 20:13:10','2019-03-29 20:13:10',NULL,26),(722,'1806270215','자아찾는 미토 자아노트 (03007766)',3000,2500,30,'읿어버린 자아를 찾아서! 엉뚱하고 귀여운 미토 자아노트가 출시되었어요.\n한 장 한 장 즐겁게 기록하며 나와 친해지는 시간. 다 쓸 때 쯤이면 나에대해 조금 더 알게 될 거에요.\n다양한 컨텐츠로 가득한 재미있는 자아 노트로 힐링 타임을 가져보아요!\n','2019-03-29 20:13:10','2019-03-29 20:13:10',NULL,11),(723,'1806250448','앨범 basic 크라프트자착(09000826)',8500,2500,85,'두꺼운 크라프트 표지에  먹박으로 포인트를 준 네츄럴한 감성의 자착식 스크랩 앨범입니다.\n밝은 아이보리색 내지로 다양한 사이즈의 사진뿐 아니라 티켓, 영수증 등을 자유롭게 스크랩하고 꾸밀 수 있고\n스프링제본이라 사용이 편리합니다. 10매로 특별한 기념일이나 여행 앨범, 포트폴리오를 만들 때 활용해 보세요.','2019-03-29 20:13:10','2019-03-29 20:13:10',NULL,26),(724,'1806250885','노트 FOR YOU 크라프트 하트스크랩스프링(03007587)',6800,2500,68,'하트 모양의 유니크한 스프링 스크랩북이에요. 레드 컬러의 표지에 고급스러운 유광금박으로 포인트를 주었어요.\n내지는 내추럴한 느낌의 두꺼운 크라프트지 15매로 구성되어있어요.\n사진을 붙여 예쁘게 꾸미거나 자유롭게 메모할 수 있는 하트 스크랩북에 나만의 이야기를 담아보세요.','2019-03-29 20:13:10','2019-03-29 20:13:10',NULL,26),(725,'1806270045','카드 갈라파고스풍선다발 (01004276)',2500,2500,25,'귀여운 갈라파고스프렌즈 친구들 그래픽으로 된 풍선다발카드입니다.\n6개의 카드를 예쁜 리본으로 묶어 다발로 만든 후에 텍을 둘러주면 귀여운 하트풍선다발카드가 됩니다.\n뒷면에는 글을 쓸 수 있습니다. 혼자서 많은 글을 써도 되고, 여러사람들과 함께 사용해도 됩니다.\n마음을 담아 소중한 사람에게 선물해보세요.\n','2019-03-29 20:13:10','2019-03-29 20:13:10',NULL,21),(726,'1806120356','슬림캡볼펜_복숭아(15006371)',1000,2500,10,'슬림하고 심플한 몰드에 귀여운 캐릭터 일러스트가 담긴 볼펜입니다. \n캡이 있어 사용이 편리합니다.','2019-03-29 20:13:10','2019-03-29 20:13:10',NULL,13),(727,'1806250326','앨범 보통의날들 크라프트자착(09000825)',8500,2500,85,'두꺼운 크라프트 표지에  먹박으로 포인트를 준 네츄럴한 감성의 자착식 스크랩 앨범입니다.\n밝은 아이보리색 내지로 다양한 사이즈의 사진뿐 아니라 티켓, 영수증 등을 자유롭게 스크랩하고 꾸밀 수 있고\n스프링제본이라 사용이 편리합니다. 10매로 특별한 기념일이나 여행 앨범, 포트폴리오