,99,'린넨원단으로 제작된 화이트 컬러의 에코백입니다.\n앞면 상단에 귀여운 보스 얼굴이,뒷면 상단에는 보스 지느러미가 자수로 수놓아져있습니다.\n책이나 서류, 파우치 등 다양한 개인용품을 넣어 다니기에 편리합니다.\n다양한 옷스타일에 쉽게 스타일링 할 수 있습니다.','2019-03-29 20:16:24','2019-03-29 20:16:24',NULL,30),(1022,'1903190353','앞머리 고정밴드 하트 (2pcs) (26017414)',1000,2500,10,'자국없이 앞머리에 딱-붙!\n빨간 하트가 매력적인 헤어 밸크로를 소개합니다.\n\n밸크로 타입으로 앞머리가 흘러내리지 않도록\n간편하게 고정시킬 수 있어요.\n\n평상시, 메이크업시, 클렌징 시 \n다양한 상황에서 편리하게 사용할 수 있어요.\n\n오랜 시간 부착해도 자국이 남지않는\n헤어 벨크로와 함께 즐거운 하루 보내세요!\n','2019-03-29 20:16:24','2019-03-29 20:16:24',NULL,31),(1023,'1903140249','소품케이스 핑크이모지 (37002713)',12800,2500,128,'러블리한 이모지들이 그려진 핑크색상 멀티파우치입니다.\n코팅이 되어있어 방수에 탁월합니다.\n내부에 포켓이있어 간단한 소품들을 구분하여 수납할 수 있답니다~\n화장품이나 다양한 소품들을 넣어 보관하세요.','2019-03-29 20:16:24','2019-03-29 20:16:24',NULL,27),(1024,'1903270395','매직우산 화이트 달나라미토 (19001529)',28000,2500,280,'화이트 바탕에 달과 별, 그리고 미토가 귀여운 패턴으로 들어가있는 우산입니다.\n손잡이 부분의 버튼을 누르면 우산이 자동으로 펼쳐지는 3단우산입니다.\n비오는날, 들고다니거나 가방에 넣어다니기에 용이한 사이즈입니다.\n물기를 말린 우산은 우산끈으로 감아 고정한 후, 우산 케이스에 넣어 보관할 수 있습니다.','2019-03-29 20:16:24','2019-03-29 20:16:24',NULL,29),(1025,'1903140147','에코백 여행카피 (29003503)',5900,2500,59,'여행관련 레터링 프린트가 포인트되는 기본에코백 입니다.\n가볍고 무난한 아이보리 색으로 자주 찾게되는 에코백이라 사계절 내내 이용가능합니다.	\n심플하지만 멋스러워 어떤 코디에도 활용도가 높아 남녀 모두 들기좋은 데일리 아이템입니다		\n','2019-03-29 20:16:24','2019-03-29 20:16:24',NULL,30),(1026,'1903270471','PVC 온수팩 400ml 핑크 (20008627)',2800,2500,28,'몸이 으슬으슬해서 감기가 오려고 할 때, 찜질이 필요할 때, 야외에서 오래 머물러야 할 때,\n뜨거운 물을 담아 휴대하면 몸을 따뜻하게 유지할 수 있는 PVC 온수팩 입니다.\n\n핑크, 브라운의 총 2가지 색상이 있습니다.\n','2019-03-29 20:16:24','2019-03-29 20:16:24',NULL,28),(1027,'1903140255','소품케이스 그레이웰시코기 (37002714)',12800,2500,128,'웰시코기, 꽃패턴의 멀티파우치입니다.\n코팅이 되어있어 방수에 탁월합니다.\n내부에 포켓이있어 간단한 소품들을 구분하여 수납할 수 있답니다~\n화장품이나 다양한 소품들을 넣어 보관하세요.\n','2019-03-29 20:16:24','2019-03-29 20:16:24',NULL,27),(1028,'1903210181','초미니우산 가죽 하늘비글 (19001527)',16500,2500,165,'산뜻한 블루 컬러 바탕에 귀여운 비글 강아지 패턴이 그려진 초미니 우산입니다.\n손잡이가 레자 소재로 되어있어 감성적인 느낌을 더해줍니다.\n한 손에 쏙 들어오는 콤팩트한 사이즈의 초미니 우산으로 가방에 넣거나 가지고 다니기 편리합니다.\n우산을 펴고 접을 때 고리 부분에 손이 끼지 않도록 제작되어 안전하게 사용 가능합니다.','2019-03-29 20:16:24','2019-03-29 20:16:24',NULL,29),(1029,'1903270404','3단우산 민트아이스크림 (19001530)',19800,2500,198,'화이트 바탕에 민트색 아이스크림이 패턴으로 들어가있는 유니크한 우산입니다.\n손잡이 부분이 민트색상 가죽으로 되어있는 3단우산입니다.\n비오는날, 들고다니거나 가방에 넣어다니기에 용이한 사이즈입니다.\n물기를 말린 우산은 우산끈으로 감아 고정한 후, 우산 케이스에 넣어 보관할 수 있습니다.','2019-03-29 20:16:24','2019-03-29 20:16:24',NULL,29),(1030,'1903210132','3단우산 블루보스 (19001525)',18000,2500,180,'산뜻한 블루 컬러 바탕에 다양한 표정의 보스 얼굴 패턴이 그려진 3단 우산입니다.\n손잡이가 투명한 아크릴 소재로 되어있어 깔끔한 느낌을 더해줍니다.\n콤팩트한 사이즈의 3단 우산으로 가방에 넣거나 가지고 다니기 편리합니다.\n손잡이 부분에 투명끈이 달려있어 휴대가 용이하며 실용적입니다.\n우산을 펴고 접을 때 고리 부분에 손이 끼지 않도록 제작되어 안전하게 사용 가능합니다. \n','2019-03-29 20:16:24','2019-03-29 20:16:24',NULL,29),(1031,'1903270476','PVC 온수팩 400ml 브라운 (20008629)',2800,2500,28,'몸이 으슬으슬해서 감기가 오려고 할 때, 찜질이 필요할 때, 야외에서 오래 머물러야 할 때,\n뜨거운 물을 담아 휴대하면 몸을 따뜻하게 유지할 수 있는 PVC 온수팩 입니다.\n핑크, 브라운의 총 2가지 색상이 있습니다.','2019-03-29 20:16:24','2019-03-29 20:16:24',NULL,28),(1032,'1903210107','EVA우산 핑크벚꽃 (19001521)',5900,2500,59,'핑크 그라데이션에 벚꽃무늬가 그려져있는 우산입니다.\n비가오는 날, 벚꽃이 흩날리는 모습을 연출할 수 있는 우산이랍니다.	\n장우산이지만 가벼워 부담없이 들고 다닐 수 있습니다.\n우중충한 비오는날에 벚꽃우산과 사랑스러운 하루 보내세요','2019-03-29 20:16:24','2019-03-29 20:16:24',NULL,29),(1033,'1903140150','에코백 시바 (29003504)',5900,2500,59,'마이 베스트 프렌즈라고 적혀져있는 귀여운 시바견 패턴 에코백 입니다.\n가볍고 무난한 아이보리 색으로 자주 찾게되는 에코백이라 사계절 내내 이용가능합니다.\n귀엽지만 심플해 어떤 코디에도 활용도가 높아 남녀 모두 들기좋은 데일리 아이템입니다','2019-03-29 20:16:24','2019-03-29 20:16:24',NULL,30),(1034,'1903270417','3단우산 블랙카피 (19001531)',19800,2500,198,'블랙 바탕에 민트색 카피가 패턴으로 들어가있는 유니크한 우산입니다.\n손잡이 부분이 블랙색상 가죽으로 되어있는 3단우산입니다.\n비오는날, 들고다니거나 가방에 넣어다니기에 용이한 사이즈입니다.\n물기를 말린 우산은 우산끈으로 감아 고정한 후, 우산 케이스에 넣어 보관할 수 있습니다.','2019-03-29 20:16:24','2019-03-29 20:16:24',NULL,29),(1035,'1903150637','19SS 쿨팬츠 네이비 북극곰 (34009768)',13800,2500,138,'시원한 냉장고바지 원단으로 제작된 쿨팬츠입니다.\n네이비 컬러의 바탕에 북극곰 패턴이 그려져있습니다.\n무더운 여름이나 열대야, 여름 휴가철에 입으면 훨씬 시원한 여름을 보낼 수 있습니다.\n무채색이나 단조로운 반팔티에 쉽게 스타일링 할 수 있습니다.','2019-03-29 20:16:24','2019-03-29 20:16:24',NULL,32),(1036,'1903210145','3단우산 그레이 숲속하늘 우드 (19001532)',18500,2500,185,'그레이색상의 숲속 밤하늘이 그려진 우산을 소개합니다\n별이 수놓아져 있는 하늘 아래 귀여운 <시바스키>가 놀고 있어요.\n손잡이가 우드로 되어있어 고급스러운 우산입니다.\n3단으로 접을 수 있어 휴대하기 간편합니다.\n비오는 날 예쁜 우산을 사용해 보세요!\n','2019-03-29 20:16:24','2019-03-29 20:16:24',NULL,29),(1037,'1903210183','초미니우산 화이트보스 (19001534)',15000,2500,150,'귀여운 보스 패턴이 그려진 초미니 우산입니다.\n흰 바탕에 푸른빛의 보스가 깔끔하고 시원한 느낌을 주는 초미니 우산입니다.\n한 손으로 들어도 무리가 없는 콤팩트한 사이즈와 가벼운 무게, 손잡이 부분에 끈이 달려있어 휴대가 용이하며 실용적입니다.\n우산을 펴고 접을 때 고리 부분에 손이 끼지 않도록 제작되어 안전하게 사용 가능합니다. \n','2019-03-29 20:16:24','2019-03-29 20:16:24',NULL,29),(1038,'1903150704','19SS 쿨팬츠 네이비 트로피칼보스 (34009769)',13800,2500,138,'시원한 냉장고바지 원단으로 제작된 쿨팬츠입니다.\n네이비 컬러의 바탕에 보스와 야자수 나뭇잎 패턴이 그려져있습니다.\n무더운 여름이나 열대야, 여름 휴가철에 입으면 훨씬 시원한 여름을 보낼 수 있습니다.\n무채색이나 단조로운 반팔티에 쉽게 스타일링 할 수 있습니다.','2019-03-29 20:16:24','2019-03-29 20:16:24',NULL,32),(1039,'1903140244','파우치 사각폭 핑크복슝 (37002667)',12000,2500,120,'귀여운 복슝 캐릭터 파우치입니다\n여행가거나 단기간 외출시 속옷, 양말,화장품 등 간단한 소지품을 넣고 다녀보세요\n겉면에 코팅이 되어있어 방수에 탁월하답니다.\n안쪽에는 양쪽면에 주머니가 달려있어 소지품을 나눠서 보관가능합니다','2019-03-29 20:16:24','2019-03-29 20:16:24',NULL,27),(1040,'1903150625','에코백 청지 포메자수 (29003505)',9900,2500,99,'청지원단으로 제작된 에코백입니다.\n앞면 상단에 귀여운 포메라니언 얼굴이 자수로 수놓아져있습니다.\n책이나 서류, 파우치 등 다양한 개인용품을 넣어 다니기에 편리합니다.\n다양한 옷스타일에 쉽게 스타일링 할 수 있습니다.','2019-03-29 20:16:24','2019-03-29 20:16:24',NULL,30),(1041,'1903210122','3단우산 핑크토끼 손잡이 (19001524)',18000,2500,180,'러블리한 핑크빛 배경에 토끼 도트가 그려져있는 우산입니다.\n우중충한 비가오는 날에도 사랑스러운 모습을 연출할 수 있는 우산이랍니다.	\n손잡이부분이 토끼모양 포인트로 되어있어 더욱 사랑스럽습니다.\n작은사이즈의 3단우산으로 가방에 넣거나 가지고 다니기 편리합니다.','2019-03-29 20:16:24','2019-03-29 20:16:24',NULL,29),(1042,'1903270444','고무온수팩 1700ml 아이보리 (20008625)',5900,2500,59,'몸이 으슬으슬해서 감기가 오려고 할 때, 찜질이 필요할 때, 야외에서 오래 머물러야 할 때,\n뜨거운 물을 담아 휴대하면 몸을 따뜻하게 유지할 수 있는 고무 온수팩 입니다.\n\n아이보리, 브라운의 총 2가지 색상이 있습니다.\n','2019-03-29 20:16:24','2019-03-29 20:16:24',NULL,28),(1043,'1903270389','매직우산 블랙 우산쓴보스 (19001528)',28000,2500,280,'블랙 바탕에 우산을 들고있는 보스가 귀여운패턴으로 들어가있는 우산입니다.\n손잡이 부분의 버튼을 누르면 우산이 자동으로 펼쳐지는 3단우산입니다.\n비오는날, 들고다니거나 가방에 넣어다니기에 용이한 사이즈입니다.\n물기를 말린 우산은 우산끈으로 감아 고정한 후, 우산 케이스에 넣어 보관할 수 있습니다.','2019-03-29 20:16:24','2019-03-29 20:16:24',NULL,29),(1044,'1903210161','3단우산 민트 북극곰별자리 우드 (19001533)',18500,2500,185,'폴라베어와 별자리 패턴이 그려진 우산을 소개합니다.\n산뜻한 스카이 블루 색상으로 안전 보행을 도와줍니다.\n손잡이가 우드로 되어있어 고급스러운 우산입니다.\n3단으로 접을 수 있어 휴대하기 간편합니다.\n비오는 날 산뜻하고 예쁜 우산을 사용해 보세요!\n','2019-03-29 20:16:24','2019-03-29 20:16:24',NULL,29),(1045,'1903210125','매직소형우산 핑크아이렌말리 (19001522)',28000,2500,280,'러블리한 핑크빛 배경에 말리와 아이렌이 그려진 우산을 소개합니다.\n우중충한 비가오는 날에도 사랑스러운 모습을 연출할 수 있는 우산이랍니다.\n눈에 띄는 밝은 핑크 색상으로 안전 보행을 도와줍니다.\n작은사이즈의 우산으로 가방에 넣거나 가지고 다니기 편리합니다.\n비오는 날 예쁘고 귀여운 우산을 사용해 보세요!','2019-03-29 20:16:24','2019-03-29 20:16:24',NULL,29),(1046,'1903110244','파우치 청지포메 보트 자수 (37002693)',7000,2500,70,'멋스러운 청지 원단의 소품케이스를 소개합니다.\n귀여운 강아지 포메라니안 자수가 포인트로 놓아져 있습니다.\n폭이 있어 각종 소지품들을 넉넉하게 수납할 수 있습니다.\n부드러운 나일론 지퍼로 되어있어 쉽게 열고 닫을 수 있습니다.','2019-03-29 20:16:24','2019-03-29 20:16:24',NULL,27),(1047,'1903150628','에코백 핑크 고양자수 (29003506)',9900,2500,99,'린넨원단으로 제작된 인디핑크 컬러의 에코백입니다.\n앞면 상단에 귀여운 고양이 얼굴이 자수로 수놓아져있습니다.\n책이나 서류, 파우치 등 다양한 개인용품을 넣어 다니기에 편리합니다.\n다양한 옷스타일에 쉽게 스타일링 할 수 있습니다.','2019-03-29 20:16:24','2019-03-29 20:16:24',NULL,30),(1048,'1903150737','19SS 쿨팬츠 블랙 수박보스 (34009770)',13800,2500,138,'시원한 냉장고바지 원단으로 제작된 쿨팬츠입니다.\n블랙 컬러의 바탕에 보스와 수박패턴이 그려져있습니다.\n무더운 여름이나 열대야, 여름 휴가철에 입으면 훨씬 시원한 여름을 보낼 수 있습니다.\n무채색이나 단조로운 반팔티에 쉽게 스타일링 할 수 있습니다.','2019-03-29 20:16:24','2019-03-29 20:16:24',NULL,32),(1049,'1903140247','에나멜 보스 중 케이스 (37002700)',10000,2500,100,'시원한 하늘색의 보스얼굴이 그려져있는 에나멜 파우치입니다.\n크지도 작지도 않는 적당한 사이즈로 휴대하기에도 좋고 여행용 파우치로도 좋습니다!\n내부에 포켓이있어 간단한 소품이 수납가능합니다.\n뚜껑이 180도 젖혀지는 형태로 펼쳐놓고 사용하기도 좋습니다.','2019-03-29 20:16:24','2019-03-29 20:16:24',NULL,27),(1050,'1903110242','파우치 핑크고양 보트 자수 (37002692)',7000,2500,70,'귀여운 고양이 자수가 포인트인 소품케이스를 소개합니다..\n폭이 있어 각종 소지품들을 넉넉하게 수납할 수 있습니다.\n부드러운 나일론 지퍼로 되어있어 쉽게 열고 닫을 수 있습니다.','2019-03-29 20:16:45','2019-03-29 20:16:45',NULL,27),(1051,'1903080301','주머니 네이비시바 중 (33001837)',4200,2500,42,'가방 속 소품들을 실용적으로 정리할 수 있는 중 사이즈 자수 스트링 파우치입니다.\n심플한 네이비 색상에 시바견 자수로 포인트를 준 파우치 입니다.\n스트링 끈을 사용하여 간편한 오픈과 클로징이 가능하며 생활 속에서 사용하기 적당한 두께감으로\n화장품, 여성용품