476)',18000,2500,180,'깔끔한 네이비 원단에 앙증맞은 시바 자수가 박혀있는 파우치를 소개합니다.\n스트랩이 있어 이동 시에도 편리해요.\n여러가지 소품을 구분하여 수납할 수 있도록 공간이 나누어져 있어요.\n핸드폰부터 지폐, 동전, 카드 등 다양한 소품들을 수납할 수 있어요.\n이모지 자수와 앙증맞은 시바 패턴 두 가지로 만나보세요!','2019-03-29 20:17:07','2019-03-29 20:17:07',NULL,27),(1085,'1901090222','목걸이카드케이스 옐로피넛 시트지 (28002486)',5800,2500,58,'학생증, 사원증, 교통카드 등 다양한 카드를 간편하게 들고 다닐 수 있는 목걸이 카드 케이스입니다.\n목걸이와 카드 케이스가 분리 가능하며 콤팩트한 사이즈로 간편하게 카드를 휴대할 수 있습니다.\n산뜻한 옐로 컬러에 피넛 친구가 그려져있어 귀여움을 더한 아이템으로 전면에는 카드 2개, 후면에도 1개의 카드를 수납할 수 있습니다.','2019-03-29 20:17:07','2019-03-29 20:17:07',NULL,27),(1086,'1901040138','에코백 자수 블랙이모지 (29003458)',19900,2500,199,'외출 시 가볍게 매고 다니기 좋은 블랙 컬러에 금사와 다양한 컬러의 이모지 자수가 포인트가 되는 에코백입니다.\n손잡이와 어깨끈이 달려있어 다양한 형태로 착용이 가능합니다. \n측면에 반짝이는 금사 주자 라벨을 달아 포인트를 준 아이템입니다.\n내부에 포켓이 따로 있어 별도로 소지품 수납이 가능합니다.','2019-03-29 20:17:07','2019-03-29 20:17:07',NULL,30),(1087,'1811120618','렌즈케이스 세트_이모지 (25013548)',3800,2500,38,'귀여운 패턴이 그려진 렌즈케이스를 소개합니다. 렌즈통과 거울이 있어, 눈이 피곤할 때면 언제 어디서든지 빼고 착용이 가능합니다. 한 손에 잡을 수 있는 사이즈로 휴대하기도 편리하답니다.\n렌즈케이스는 용도 외에는 사용하지 않도록 하며, 화기에 가까이 두지 않도록 해주세요.\n','2019-03-29 20:17:07','2019-03-29 20:17:07',NULL,31),(1088,'1901160682','HAIR 샴푸브러시 바이올렛 (26016587)',3000,2500,30,'손이 닿지 않는 구석까지 씻어내고,\n마사지 효과로 두피 케어를 도와주는 샴푸 브러시예요.\n샴푸브러시로 머리카락 사이사이를 상쾌하게 씻어내세요!\n','2019-03-29 20:17:07','2019-03-29 20:17:07',NULL,35),(1089,'1901160604','HAIR 샴푸브러시 블루 (26016586)',3000,2500,30,'손이 닿지 않는 구석까지 씻어내고,\n마사지 효과로 두피 케어를 도와주는 샴푸 브러시예요.\n샴푸브러시로 머리카락 사이사이를 상쾌하게 씻어내세요!\n','2019-03-29 20:17:07','2019-03-29 20:17:07',NULL,35),(1090,'1901090251','3단우산 연두라벨 (19001538)',9900,2500,99,'심플한 디자인의 솔리드 그린 컬러의 3단 우산입니다.\n8폭으로 만들어져있고 탄탄한 살대들이 받쳐주어 강한 바람도 잘 막아줍니다.\n측면에 브라운 컬러의 TOPLOOK 주자 라벨을 달아 포인트를 준 아이템입니다.','2019-03-29 20:17:07','2019-03-29 20:17:07',NULL,29),(1091,'1901172492','아이렌 칼라지퍼백 (25014322)',2000,2500,20,'귀여운 아이렌 캐릭터 지퍼백이예요.\n여행용품, 화장품 등 작은 소품을 정리할 수 있는 실용적인 지퍼백!\n','2019-03-29 20:17:07','2019-03-29 20:17:07',NULL,27),(1092,'1812260442','와펜핀 아기보스 (34009611)',2500,2500,25,'귀여운표정의 아기보스 와펜핀입니다.\n파우치, 에코백, 백팩 등 다양한곳