:17:07',NULL,34),(1101,'1812240372','마스크 ㅋㅋㅋ 블랙 (34009581)',2500,2500,25,'유머러스한 ㅋㅋㅋ이 그려져있는 블랙 마스크입니다.\n블랙컬러에 흰색 포인트 그래픽으로 무난하게 착용가능합니다\n한겨울이나 미세먼지가 심한날, 감기에걸린날 등등 마스크가 필요한날에 사용해보세요!','2019-03-29 20:17:07','2019-03-29 20:17:07',NULL,31),(1102,'1901090273','3단우산 옐로라벨 (19001535)',9900,2500,99,'심플한 디자인의 솔리드 옐로 컬러의 3단 우산입니다.\n8폭으로 만들어져있고 탄탄한 살대들이 받쳐주어 강한 바람도 잘 막아줍니다.\n측면에 퍼플 컬러의 TOPLOOK 주자 라벨을 달아 포인트를 준 아이템입니다.','2019-03-29 20:17:07','2019-03-29 20:17:07',NULL,29),(1103,'1901090168','카드지갑 네이비 금박폭 (28002490)',18000,2500,180,'’Beautiful life’ 문구가 골드 금박으로 포인트가 되어주는 심플한 네이비 컬러의 카드 지갑입니다.\n카드와 지폐, 영수증 등을 보관할 수 있고 콤팩트한 사이즈로 들고 다니기에 부담이 없는 크기로 제작되었습니다.\n한 쪽 면은 투명 PVC 창으로 되어있어 카드를 꺼내지 않아도 확인이 가능하여 편리함을 더했습니다.\n무광의 가죽 소재와 심플한 디자인으로 고급스러움을 더했습니다.','2019-03-29 20:17:07','2019-03-29 20:17:07',NULL,27),(1104,'1901172407','지퍼백(특소)_복슝 (25014817)',1200,2500,12,'여행용품을 수납하거나 화장품을 보관할 때,\n또는 아기자기한 작은 소품 등 정리&보관에 실용적인 지퍼백(특소)입니다.\n','2019-03-29 20:17:07','2019-03-29 20:17:07',NULL,27),(1105,'1812270440','고양이모양 브러쉬 시바 (13000695)',3500,2500,35,'귀여운 시바 캐릭터가 들어간 헤어브러쉬입니다.\n유연한 빗살로 머리결을 부드럽게 가꾸어보세요.\n','2019-03-29 20:17:07','2019-03-29 20:17:07',NULL,35),(1106,'1901090236','멀티파우치 핑크 이모지 (28002475)',18000,2500,180,'핑크색 원단에 다양하고 아기자기한 이모지 자수가 박혀있는 파우치를 소개합니다.\n스트랩이 있어 이동 시에도 편리해요.\n여러가지 소품을 구분하여 수납할 수 있도록 공간이 나누어져 있어요.\n핸드폰부터 지폐, 동전, 카드 등 다양한 소품들을 수납할 수 있어요.\n이모지 자수와 앙증맞은시바 패턴 두 가지로 만나보세요!','2019-03-29 20:17:07','2019-03-29 20:17:07',NULL,27),(1107,'1812260343','소품케이스 에나멜 웰시코기 반달 (37002632)',8500,2500,85,'귀여운 웰시코기 패턴이 그려진 반달파우치를 소개합니다!\n에나멜 소재의 특유의 광택으로 고급스럽고 때가 타도 잘 지워져요.\n무광 골드의 지퍼로 고급스러움이 한층 업그레이드 되었어요.\n넉넉한 사이즈로 소지품을 넣어도 모양이 흐트러지지 않아요.\n','2019-03-29 20:17:07','2019-03-29 20:17:07',NULL,27),(1108,'1812260429','에코백 자수 네이비 시바 (29003457)',19900,2500,199,'앙증맞은 시바가 가득한 에코백을 소개합니다!\n시바가 자수로 표현되어 소장가치가 있는 제품이에요.\n다양한 스타일에 어울려요.\n각종 소지품들을 넉넉히 수납할 수 있어요.\n내부에 작은 포켓이 있어서 카드, 지폐, 립밤등 작은 소지품을 수납할 수 있어요.','2019-03-29 20:17:07','2019-03-29 20:17:07',NULL,30),(1109,'1901090226','목걸이카드케이스 블랙이모지 시트지 (28002487)