0:20:01','2019-03-29 20:20:01',NULL,41),(1344,'1903120662','빅머그 많이머그셈 (22004398)',5800,2500,58,'많이 머그셈!\n귀여운 보스 그래픽이 그려진 빅머그를 소개합니다.\n\n도자제 재질로 약 887ml 대용량으로  \n넉넉하게 사용할 수 있어요.\n\n엄지 척! 귀여운 보스와 재미있는 카피가 매력적인\n빅 머그와 함께 즐거운 하루 보내세요!\n','2019-03-29 20:20:01','2019-03-29 20:20:01',NULL,40),(1345,'1903110092','칫솔 지퍼케이스세트 옐로우말리 (25014805)',3500,2500,35,'귀여운 말리 투명 지퍼케이스에 담긴 칫솔과 치약세트예요!\n간편하게 가방에 쏙 넣어 다닐 수 있어 편리하답니다.\n매일 깔끔하게 칫솔치약세트로 관리하세요!','2019-03-29 20:20:01','2019-03-29 20:20:01',NULL,39),(1346,'1902150418','머그컵뚜껑_블루블록 (22004483)',3500,2500,35,'말랑말랑~ 귀여운 블록모양 손잡이가 있는\n블록 실리콘 컵 커버를 소개합니다.\n\n컵 위에 올려 가운데를 꾹 누르면\n살짝 기울여도, 뚜껑을 당겨도 쉽게 열리지 않아요.\n\n블록 손잡이에 티스푼, 포크등을 꽂아\n편리하게 사용할 수 있어요.\n\n귀여운 블록 실리콘 컵커버와 함께 \n티타임을 즐겨보세요!\n','2019-03-29 20:20:01','2019-03-29 20:20:01',NULL,40),(1347,'1812270409','글리터 텀블러 실버(LOVE) (22004355)',5800,2500,58,'글리터가 들어간 실버 텀블러를 소개할게요!\n내용물이 움직이며 반짝여서 더 화려하고 예뻐보인답니다. \n어떤 음료를 넣어도 블링블링~\n글리터 텀블러로 나만의 엣지있는 스타일을 완성하세요!\n','2019-03-29 20:20:01','2019-03-29 20:20:01',NULL,41),(1348,'1902200825','실버 커피 머그텀블러 (500ml) (22004481)',18000,2500,180,'사랑스러운 문구와 하트 캐릭터가 새겨진 커피머그텀블러를 소개할게요~\n스테인리스스틸 재질로 보온성이 뛰어나고\n뚜껑에 손잡이가 있어 편리한 제품이랍니다.\n휴대성을 높이기 위해 손잡이는 접었다 폈다 할 수 있어요.\n실버 색상의 커피머그텀블러와 함께 즐거운 커피 타임 되세요!\n','2019-03-29 20:20:01','2019-03-29 20:20:01',NULL,41),(1349,'1901220392','파스텔 젓가락 세트(4set) (53009000)',9900,2500,99,'알록달록 귀여운 파스텔컬러의 젓가락 세트를 소개할게요.\n빨간색, 노란색, 파란색, 하늘색의 총 4쌍의 젓가락이 들어있고 \n일반 식사용 쇠젓가락보다 긴 23cm으로 편리성을 높혔어요!\n보통의 플라스틱 젓가락보다 가볍고 내구성이 좋으며\n스테인레스처럼 느껴지는 쨍쨍한 재질로 제작되어 사용 시 만족하실거에요!','2019-03-29 20:20:01','2019-03-29 20:20:01',NULL,4),(1350,'1901160532','스터링 텀블러 (22004427)',13900,2500,139,'간편하게 쉐이크를 만들 수 있는 스터링텀블러를 소개할게요!\n버튼을 누르면 회오리 물살을 일으키며 음료를 섞어줍니다.\n미숫가루, 꿀물, 선식 등 내용물을 넣고 버튼만 누르면 완료~\n이제 젓지말고 눌러주세요!\n','2019-03-29 20:20:01','2019-03-29 20:20:01',NULL,41),(1351,'1902270415','피규어 빨대텀블러 핑크말리 (22004412)',9800,2500,98,'튜브를 끼고있는 말리 피규어가 달린 아이스텀블러를 소개할게요.\n몸통 부분에는 수영하고있는 말리가 그려져있어 더욱 시원하게 느껴질거예요!\n스트로우가 내장되어 있어 편하게 음료를 이용할 수 있답니다.\n피규어 빨대텀블러로 시원하게 즐기세요!\n',