19-03-29 20:20:22',NULL,41),(1377,'1812040677','큐방칫솔_핑크 원숭이 (25013412)',1500,2500,15,'귀여운 핑크 원숭이의 얼굴이 달려있는 칫솔을 소개할게요.\n뒷면에 흡착부분이 있어서 거울이나 유리 등에 붙일 수 있답니다.\n피규어 칫솔로 양치질 할 때도 귀엽고 개성있게!!\n','2019-03-29 20:20:22','2019-03-29 20:20:22',NULL,43),(1378,'1811070441','아이스크림텀블러 연핑크 (22004442)',6500,2500,65,'산뜻한 연핑크컬러에 귀여운 얼굴이 그려진 아이스크림 텀블러를 소개할게요\n아이스크림 콘 모양으로 되어있어 더욱 귀엽고 재미있게 사용할 수 있어요~\n또한 스트로우가 함께 구성되어 있어 음료를 편리하게 마실 수 있답니다~ \n집에서도 카페처럼 시원하고 귀여운 티테이블을 완성해보세요!\n','2019-03-29 20:20:22','2019-03-29 20:20:22',NULL,41),(1379,'1811120560','페이스 타월_네이비 (26016640)',3800,2500,38,'귀여운 강아지가 새겨진 페이스 타월을 소개해요~\n100% 면으로 제작되었어요.\n강아지가 디자인 되어있는 페이스 타월과 함께 쾌적한 하루를 보내세요!','2019-03-29 20:20:22','2019-03-29 20:20:22',NULL,43),(1380,'1810300422','스텐텀블러 350ml 보스 (22004292)',8900,2500,89,'텀블러 내부가 스테인레스 재질로 되어있는 스텐텀블러를 소개해요.\n텀블러 내부가 스테인레스로 되어있기 때문에\n여름철에는 음료를 더 시원하게, 더 오래 유지할 수 있구요.\n추운 겨울철에는 따뜻한 음료의 온도를 더 오래 유지시켜 줘요.\n또한 뜨거운 음료를 마실 때, 환경호르몬의 영향을 받지않아\n더 건강하게 음료를 즐기실 수 있어요.\n보기만해도 너무 귀여워서 미소가 지어지는\n분홍색 배경의 귀여운 보스 패턴이 있는 스텐텀블러와 함께 \n건강하고 즐겁게 음료를 즐겨보세요!\n','2019-03-29 20:20:22','2019-03-29 20:20:22',NULL,41),(1381,'1811070324','캐릭터머그_피터 그레이 (22004396)',2500,2500,25,'따뜻한 그레이 컬러가 매력적인 캐릭터머그를 소개 합니다.\n머그는 도자제로 만들어졌으며, 심플한 로고와 함께 피터의 얼굴이 그려져 있어 선물용으로도 좋습니다. \n용량은 370ml이고 손잡이의 그립감도 좋아 언제든지 편리하게 사용할 수 있답니다.  \n귀여운 캐릭터 머그로 즐거운 티타임과 함께 주방을 예쁘게 장식해보세요.','2019-03-29 20:20:22','2019-03-29 20:20:22',NULL,40),(1382,'1811090458','메탈텀블러 그라데이션 (22004429)',19800,2500,198,'신비로운 그라데이션 텀블러를 소개할게요~\n550ml의 용량의 스틸재질의 텀블러라\n보온에 우수하고 빨대를 이용해서 간편하게 음료를 마실 수 있어요~\n스틸텀블러를 사용할 때는, 강한 충격이나 파손을 주의해주시고\n화기에 가까이 두지 않도록 해주세요.','2019-03-29 20:20:22','2019-03-29 20:20:22',NULL,41),(1383,'1811070852','일자 스틸텀블러 말리 실버 (22004371)',13800,2500,138,'스틸텀블러에 귀여운 말리가 그려진 로즈골드 스틸텀블러를 소개할게요.\n500ml의 용량의 스틸재질의 텀블러라 음료를 가득 담을 수 있어요.\n스틸재질로 보온에 우수하고뚜껑이 있어 휴대성도 뛰어나답니다~\n스틸텀블러를 사용할 때는, 강한 충격이나 파손을 주의해주시고\n화기에 가까이 두지 않도록 해주세요.','2019-03-29 20:20:22','2019-03-29 20:20:22',NULL,41),(1384,'1811050017','스텐아이스빨대 텀블러 올리버(화이트) (22004287)',9900,2500,99,'스테인레스 재질의 빨대가 들어있는 스탠아이스빨대텀블러를 소개할게요.\n텀블러 뚜껑과 빨대가 스테인레스 재질로 음료를 더 시원하게 즐길 수가 있어요.\n입술끝에 닿았을 때 스테인레스 재질이 주는 시원한 느낌은 음료를 더 \n시원하게 느끼게 해줘요!','2019-03-29 20:20:22','2019-03-29 20:20:22',NULL,41),(1385,'1811050086','스텐텀블러 말리(핑크) (22004295)',9900,2500,99,'텀블러 내부가 스테인레스 재질로 되어있는 스텐텀블러를 소개해요.\n텀블러 내부가 스테인레스로 되어있기 때문에\n여름철에는 음료를 더 시원하게, 더 오래 유지할 수 있구요.\n추운 겨울철에는 따뜻한 음료의 온도를 더 오래 유지시켜 줘요.\n또한 뜨거운 음료를 마실 때, 환경호르몬의 영향을 받지않아\n더 건강하게 음료를 즐기실 수 있어요.\n귀여운 말리 캐릭터가 그려진 스텐텀블러와 함께 \n건강하고 즐겁게 음료를 즐겨보세요!\n','2019-03-29 20:20:22','2019-03-29 20:20:22',NULL,41),(1386,'1811070834','뚜껑 스틸텀블러 실버 (22004369)',13800,2500,138,'스틸텀블러에 사랑스러운 카피가 새겨진 실버 스틸텀블러를 소개할게요.\n380ml의 용량의 스틸재질의 텀블러라 \n보온에 우수하고 손잡이가 있어 사용이 편리하답니다.\n뚜껑이 있어 휴대성도 뛰어나답니다~\n스틸텀블러를 사용할 때는, 강한 충격이나 파손을 주의해주시고\n화기에 가까이 두지 않도록 해주세요.','2019-03-29 20:20:22','2019-03-29 20:20:22',NULL,41),(1387,'1811050013','흰색손잡이머그 물방울 (22004447)',7500,2500,75,'사랑스러운 물방울 모양이 그려져있는 화이트 머그를 소개할게요.\n길쭉 모양의 머그컵으로 많은 용량의 음료를 담을 수 있어요.\n은은한 무광 타입으로 더욱 고급스러운 느낌을 준답니다.\n흰색 머그로 카페, 사무실 등 어디서나 편안한 티타임을 즐기세요!\n','2019-03-29 20:20:22','2019-03-29 20:20:22',NULL,40),(1388,'1810300380','스텐텀블러 350ml 하트 (22004291)',8900,2500,89,'텀블러 내부가 스테인레스 재질로 되어있는 스텐텀블러를 소개해요.\n텀블러 내부가 스테인레스로 되어있기 때문에\n여름철에는 음료를 더 시원하게, 더 오래 유지할 수 있구요.\n추운 겨울철에는 따뜻한 음료의 온도를 더 오래 유지시켜 줘요.\n또한 뜨거운 음료를 마실 때, 환경호르몬의 영향을 받지않아\n더 건강하게 음료를 즐기실 수 있어요.\n귀여운 하트 패턴이 그려진 스텐텀블러 하트와 함께 \n건강하고 즐겁게 음료를 즐겨보세요!\n','2019-03-29 20:20:22','2019-03-29 20:20:22',NULL,41),(1389,'1812040271','스틸텀블러 실버 북극곰 (300ml) (22004364)',12000,2500,120,'귀여운 북극곰 스틸텀블러를 소개할게요~\n300ml의 용량의 스틸텀블러로 보온성이 우수해요.\n가벼워서 외출시에 간편하게 사용하기도 좋아요!\n스틸텀블러를 사용할 때는, 강한 충격이나 파손을 주의해주시고\n화기에 가까이 두지 않도록 해주세요.\n','2019-03-29 20:20:22','2019-03-29 20:20:22',NULL,41),(1390,'1811080245','쉐이커 텀블러_레드 (22004419)',13900,2500,139,'쉐킷~쉐킷 음료를 섞어주는\n쉐이커 텀블러를 소개합니다.\n\n간편하게 쉐이커를 만들 수 있는 텀블러로\n버튼을 누르면 음료를 골고루 섞어줍니다.\n\n힘들이지 않고 언제든지 \n음료를 간편하게 섞을 수 있어요.\n\n재미있는 문구가 그려져 있어 \n보는 재미까지 솔솔~\n\n쉐이커 텀블러와 함께\n건강한 하루 보내세요!','2019-03-29 20:20:22','2019-03-29 20:20:22',NULL,41),(1391,'1811050046','스텐텀블러 올리버(블랙) (22004290)',9900,2500,99,'텀블러 내부가 스테인레스 재질로 되어있는 스텐텀블러를 소개해요.\n텀블러 내부가 스테인레스로 되어있기 때문에\n여름철에는 음료를 더 시원하게, 더 오래 유지할 수 있구요.\n추운 겨울철에는 따뜻한 음료의 온도를 더 오래 유지시켜 줘요.\n또한 뜨거운 음료를 마실 때, 환경호르몬의 영향을 받지않아\n더 건강하게 음료를 즐기실 수 있어요.\n귀여운 올리버 캐릭터가 그려진 스텐텀블러와 함께 \n건강하고 즐겁게 음료를 즐겨보세요!','2019-03-29 20:20:22','2019-03-29 20:20:22',NULL,41),(1392,'1811120546','페이스 타월_옐로우 (26016642)',3800,2500,38,'깜찍한 여우가 새겨진 페이스 타월을 소개해요~\n100% 면으로 제작되었어요.\n여우가 디자인 되어있는 페이스 타월과 함께 쾌적한 하루를 보내세요!','2019-03-29 20:20:22','2019-03-29 20:20:22',NULL,43),(1393,'1811120537','페이스 타월_블루 (26016643)',3800,2500,38,'귀여운 북극곰이 새겨진 페이스 타월을 소개해요~\n100% 면으로 제작되었어요.\n북극곰이 디자인 되어있는 페이스 타월과 함께 쾌적한 하루를 보내세요!','2019-03-29 20:20:22','2019-03-29 20:20:22',NULL,43),(1394,'1811070402','컬러메이슨자 옐로아이렌 (22004416)',4900,2500,49,'반투명 옐로우컬러에 귀여운 아이렌이 그려진 컬러메이슨자를 소개할게요\n650ml의 용량으로 한번에 많은  양을 담을 수 있으며, 손잡이가 있어 휴대성이 좋아요.\n또한 스트로우가 함께 구성되어 있어 음료를 편리하게 마실 수 있답니다~ \n집에서도 카페처럼 시원하고 귀여운 티테이블을 완성해보세요!\n','2019-03-29 20:20:22','2019-03-29 20:20:22',NULL,40),(1395,'1811070824','뚜껑 스틸텀블러 로즈골드 (22004368)',13800,2500,138,'스틸텀블러에 사랑스러운 카피가 새겨진 로즈골드 스틸텀블러를 소개할게요.\n380ml의 용량의 스틸재질의 텀블러라 \n보온에 우수하고 손잡이가 있어 사용이 편리하답니다.\n뚜껑이 있어 휴대성도 뛰어나답니다~\n스틸텀블러를 사용할 때는, 강한 충격이나 파손을 주의해주시고\n화기에 가까이 두지 않도록 해주세요.','2019-03-29 20:20:22','2019-03-29 20:20:22',NULL,41),(1396,'1811050008','흰색손잡이머그 하트 (22004446)',7500,2500,75,'사랑스러운 하트모양이 그려져있는 화이트 머그를 소개할게요.\n길쭉 모양의 머그컵으로 많은 용량의 음료를 담을 수 있어요.\n은은한 무광 타입으로 더욱 고급스러운 느낌을 준답니다.\n흰색 머그로 카페, 사무실 등 어디서나 편안한 티타임을 즐기세요!\n','2019-03-29 20:20:22','2019-03-29 20:20:22',NULL,40),(1397,'1811070450','아이스크림텀블러 오토 스카이블루 (22004443)',6500,2500,65,'산뜻한 스카이블루컬러에 귀여운 오토 얼굴이 그려진 아이스크림 텀블러를 소개할게요\n아이스크림 콘 모양으로 되어있어 더욱 귀엽고 재미있게 사용할 수 있어요~\n또한 스트로우가 함께 구성되어 있어 음료를 편리하게 마실 수 있답니다~ \n집에서도 카페처럼 시원하고 귀여운 티테이블을 완성해보세요!\n','2019-03-29 20:20:22','2019-03-29 20:20:22',NULL,41),(1398,'1812040269','스틸텀블러 실버 하트 (300ml) (22004365)',12000,2500,120,'스마일 하트 캐릭터가 그려진 스틸텀블러를 소개할게요~\n300ml의 용량의 스틸텀블러로 보온성이 우수해요.\n가벼워서 외출시에 간편하게 사용하기도 좋아요!\n스틸텀블러를 사용할 때는, 강한 충격이나 파손을 주의해주시고\n화기에 가까이 두지 않도록 해주세요.\n','2019-03-29 20:20:22','2019-03-29 20:20:22',NULL,41),(1399,'1810300355','캐릭터머그_오스트 (22004281)',2500,2500,25,'상큼한 옐로우 컬러가 매력적인 캐릭터머그를 소개 합니다.\n머그는 도자제로 만들어졌으며, 귀여운 오스트의 얼굴이 그려져 있어 선물용으로도 좋습니다. \n용량은 370ml이고 손잡이의 그립감도 좋아 언제든지 편리하게 사용할 수 있답니다.  \n귀여운 캐릭터 머그로 즐거운 티타임과 함께 주방을 예쁘게 장식해보세요.\n','2019-03-29 20:20:22','2019-03-29 20:20:22',NULL,40),(1400,'1811070376','컬러메이슨자 핑크카피 (22004415)',4900,2500,49,'반투명 핑크컬러에 상큼한 카피가 그려진 컬러메이슨자를 소개할게요\n650ml의 용량으로 한번에 많은  양을 담을 수 있으며, 손잡이가 있어 휴대성이 좋아요.\n또한 스트로우가 함께 구성되어 있어 음료를 편리하게 마실 수 있답니다~ \n집에서도 카페처럼 시원하고 예쁜 티테이블을 완성해보세요!\n','2019-03-29 20:20:22','2019-03-29 20:20:22',NULL,40),(1401,'1811080240','쉐이커 텀블러_그레이 (22004418)',13900,2500,139,'돌리고~돌리고 음료를 섞어주는\n쉐이커 텀블러를 소개합니다.\n\n간편하게 쉐이커를 만들 수 있는 텀블러로\n버튼을 누르면 음료를 골고루 섞어줍니다.\n\n힘들이지 않고 언제든지 \n음료를 간편하게 섞을 수 있어요.\n\n재미있는 문구가 그려져 있어 \n보는 재미까지 솔솔~\n\n쉐이커 텀블러와 함께\n건강한 하루 보내세요!\n','2019-03-29 20:20:22','2019-03-29 20:20:22',NULL,41),(1402,'1810300302','캐릭터머그_아이렌 (22004280)',2500,2500,25,'깨끗한 화이트 컬러가 매력적인 캐릭터머그를 소개 합니다.\n머그는 도자제로 만들어졌으며, 귀여운 아이렌의 얼굴이 그려져 있어 선물용으로도 좋습니다. \n용량은 370ml이고 손잡이의 그립감도 좋아 언제든지 편리하게 사용할 수 있답니다.  \n귀여운 캐릭터 머그로 즐거운 티타임과 함께 주방을 예쁘게 장식해보세요\n','2019-03-29 20:20:22','2019-03-29 20:20:22',NULL,40),(1403,'1811050028','스텐아이스빨대 텀블러 말리(핑크) (22004288)',9900,2500,99,'스테인레스 재질의 빨대가 들어있는 스탠아이스빨대텀블러를 소개할게요.\n텀블러 뚜껑과 빨대가 스테인레스 재질로\n더운 여름철, 음료를 더 시원하게 즐길 수가 있어요.\n입술끝에 닿았을 때 스테인레스 재질이 주는 시원한 느낌은 음료를 더 \n시원하게 느끼게 해줘요!\n','2019-03-29 20:20:22','2019-03-29 20:20:22',NULL,41),(1404,'1810300435','스텐텀블러 350ml 올리버 (22004293)',8900,2500,89,'텀블러 내부가 스테인레스 재질로 되어있는 스텐텀블러를 소개해요.\n텀블러 내부가 스테인레스로 되어있기 때문에\n여름철에는 음료를 더 시원하게, 더 오래 유지할 수 있구요.\n추운 겨울철에는 따뜻한 음료의 온도를 더 오래 유지시켜 줘요.\n또한 뜨거운 음료를 마실 때, 환경호르몬의 영향을 받지않아\n더 건강하게 음료를 즐기실 수 있어요.\n보기만해도 너무 귀여워서 미소가 지어지는\n민트색 배경의 귀여운 올리버 패턴이 있는 스텐텀블러와 함께 \n건강하고 즐겁게 음료를 즐겨보세요!','2019-03-29 20:20:22','2019-03-29 20:20:22',NULL,41),(1405,'1810080327','머그컵 핑크 아이렌 (22004274)',2500,2500,25,'귀여운 캐릭터의 얼굴이 들어간 머그컵입니다~\n따뜻함을 오래 보존