28:54',NULL,64),(2151,'1901220486','버섯청소기_민트 (26016259)',6800,2500,68,'휴대성이 뛰어난 깜찍한 버섯 모양의 다용도 청소기를 소개할게요!\n협소한 공간의 틈새 청소도 손쉽고 깔끔하게 할 수 있어\n차량 내부 청소, 전자제품 표면 먼지 제거에 탁월해요.\n책상 위 이물질 제거나 쿠션, 침구류 먼지 제거용으로 사용할 수 있어요.\n민트 버섯 청소기로 간편하고 편리하게 청소해보세요~\n','2019-03-29 20:28:54','2019-03-29 20:28:54',NULL,65),(2152,'1811080249','무드볼가습기 화이트 (26015921)',24900,2500,249,'귀여운 캐릭터 얼굴이 그려진 하얀 무드볼 가습기를 소개합니다.\n\n무드볼 가습기는 MHZ 분무칩이 내장되어 있어 하얀 가루 현상 없이\n물을 뿜어내요!\n스위치만 가볍게 터치해주면 신선한 공기를 얻을 수 있고\n공간을 촉촉하게 해줘요.\n\n조명색도 변해 상황과 분위기에 맞게 사용할 수 있어요.\n무드볼 가습기와 함께 촉촉하고 무드있는 겨울을 보내세요!','2019-03-29 20:28:54','2019-03-29 20:28:54',NULL,60),(2153,'1811070780','물방울가습기_핑크 (26015913)',18000,2500,180,'작고 아담한 물방울모양 가습기를 소개할게요.\n버튼 하나로 심플하게 사용 가능해서 편리해요.\nUSB를 꽂으면 방, 사무실 등 어디에서나 바로 가습을 시작할 수 있답니다.\n귀여운 물방울가습기로 수분 가득한 하루 보내세요!\n','2019-03-29 20:28:54','2019-03-29 20:28:54',NULL,60),(2154,'1812060786','iCUBE 케이블보호캡 아이렌 (26016378)',3900,2500,39,'구부러지거나 손상되기 쉬운 부분을 고정해주는 아이폰 케이블 보호캡입니다.\n갈라파고스 프렌즈의 아이렌이 귀여움을 자아냅니다.\n','2019-03-29 20:28:54','2019-03-29 20:28:54',NULL,59),(2155,'1902140458','노트북파우치 블랙악어 15인치 (37002689)',25000,2500,250,'심플한 블랙색상의 15인치형 노트북 파우치입니다.\n부드러운 면 원단에 스펀지가 내장되어있어 폭신폭신하기때문에 노트북을 안전하게 보관할 수 있습니다.\n전면에 초록빛 <악어> 패턴이 자수로 수놓아져 있습니다.\n지퍼탭이 2개가 장착되어있어  노트북 파우치를 열고 닫기 수월합니다.\n13인치 형으로는  지프렌즈 <보스> 패턴이 자수로 수놓여진 코랄색상의 노트북 파우치가 있습니다.','2019-03-29 20:28:54','2019-03-29 20:28:54',NULL,62),(2156,'1901220506','미니청소기 화이트 (26015145)',9900,2500,99,'한 손에 쏙 들어오는 귀여운\n미니 청소기를 소개합니다.\n\n컴퓨터 본체, 키보드, 좁은 틈 사이의\n먼지를 제거하기 좋아요.\n\nUSB로 간편하게 작동이 가능하며\n다양한 청소솔로 손쉽게 청소할 수 있어요.\n\n청소 후 흡수된 먼지들은 본체를 분리해서 \n간편하게 제거할 수 있어요.\n\n구석구석 깔끔하게 청소하는 데스크 클리너로\n쾌적한 하루 보내세요!\n','2019-03-29 20:28:54','2019-03-29 20:28:54',NULL,65),(2157,'1902150017','손목쿠션 핑크고양 길쭉패턴 (34009636)',5800,2500,58,'귀여운 고양이 패턴의 길쭉한 손목쿠션을 소개합니다!\n솜으로 가득 채워져있어 폭신폭신합니다.\n키보드 앞에 두고 두 손목을 받쳐 사용해주세요.\n두 손목의 부담을 덜고 편안하게 작업을 할 수 있습니다.\n','2019-03-29 20:28:54','2019-03-29 20:28:54',NULL,62),(2158,'1901220426','아이론 봉고데기 #32 그레이보스 (26016962)',27800,2500,278,'부스스하고 지저분한 머리가 