0,10,'워터프루프 재질로 되어 있는 러기지 스티커입니다. \n자랑스러운 우리나라 태극기를 캐리어에 붙여 나만의 개성을 나타낼 수 있고, 눈에 잘 띄어 수화물을 찾을 때도 좋아요!\n종이스티커가 아니기 때문에 텀블러나 학용품 등에 붙여도 걱정 없이 사용할 수 있어요.\n','2019-03-29 20:31:23','2019-03-29 20:31:23',NULL,45),(2399,'1903190359','아크릴 주차알림판 (핑크) (53009040)',1500,2500,15,'숫자칩을 끼워 간편하게 사용하는 \n아크릴 주차알림판을 소개합니다.\n\n귀여운 핑크톤의 디자인과\n큐방 장착 방식으로 쉽게 탈부착 할 수있어요.\n\n간편하게 숫자칩을 빼고 끼울 수 있어\n전화번호 변경시에도 재구성하여 사용 할수 있어요.\n\n심플하고 편리한 아크릴 주차알림판과 함께 \n즐거운 하루 보내세요!\n','2019-03-29 20:31:23','2019-03-29 20:31:23',NULL,58),(2400,'1901240249','여행용키트 아이렌 (25013473)',2900,2500,29,'4개의 용기가 들어있는 여행용키트입니다.\n2가지 종류의 용기가 2개씩 들어있어 여행갈 때 로션, 크림 등을 소분하기 좋습니다.\n크림용기에는 크림 뿐 아니라 작은 소품이나 악세사리를 손쉽게 보관할 수 있답니다.\n스파출러가 있어 더욱 편리하고 위생적으로 사용이 가능해요.\n','2019-03-29 20:31:23','2019-03-29 20:31:23',NULL,45),(2401,'1901310571','스티커 미토 원형 주차번호 (04009385)',1500,2500,15,'주차할 때는 전화번호를 남겨두는 센스 !  원형 주차번호 스티커로 간편하게 전화번호를 남겨두세요.\n함께 들어있는 숫자 스티커를 조합하여 전화번호를 붙여보세요. 네모칸에 맞춰서 붙이면 깔끔합니다.\n귀여운 미토 캐릭터가 포인트 ! 앞 유리에 붙여주면 정말 귀여워요. 간단히 붙일 수 있어 편하고 실용적인 주차번호 스티커입니다.\n','2019-03-29 20:31:23','2019-03-29 20:31:23',NULL,58),(2402,'1902130795','스티커 러기지 보스 vonvoyage (04009425)',1000,2500,10,'워터프루프 재질로 되어 있는 러기지 스티커입니다. \n여행자 컨셉의 귀여운 보스 캐릭터 스티커를 캐리어에 붙여 나만의 개성을 나타낼 수 있고, 눈에 잘 띄어 수화물을 찾을 때도 좋아요!\n종이스티커가 아니기 때문에 텀블러나 학용품 등에 붙여도 걱정 없이 사용할 수 있어요.\n','2019-03-29 20:31:23','2019-03-29 20:31:23',NULL,45),(2403,'1901310670','캐리어 블랙 24인치 (29003527)',55000,2500,550,'여행용 캐리어 24인치 블랙 색상입니다.\n모던한 색상으로 더욱 멋스럽게 사용하실 수 있습니다.\n캐리어 우측에 비밀번호 잠금장치가 있어 안심하고 사용하실 수 있습니다.\n캐리어를 간단하게 들 수 있는 손잡이와 높이 조절이 가능한 손잡이가 있습니다.\n캐리어 내부에는 물건을 안전하게 고정할 수 있는 버클이 있습니다.','2019-03-29 20:31:23','2019-03-29 20:31:23',NULL,73),(2404,'1901220221','캐리어 갈라파고스 프렌즈 20인치 (29003524)',65000,2500,650,'귀여운 갈라파고스 프렌즈 친구들과 함께 여행을 떠나요!\n사랑스러운 갈라파고스 프렌즈 친구들이 함께하는 화사한 색감이 돋보이는 20인치 캐리어입니다. \n앞, 뒷면이 다른 그래픽으로 디자인되어 유니크함을 더했습니다.\n수납공간이 넓은 내부입니다. 소지품을 고정시켜주는 X자형 밴드,작은 사이즈 소지품을 넣을 수 있는 미니 포켓,소지품을 한눈에 쉽게 찾을수 있는 매쉬포켓이 있습니다.\n상단에 튼튼한 손잡이와 길이조절이 가능한 손잡이가 달려 있습니다.\n튼튼한 스틸소재의 길이조절이 가능한 손잡이입니다.\n2개의 지퍼가 달려 있어 여닫을때 매우 편리합니다.\n안전한 잠금장치가 달려 있습니다.\n','2019-03-29 20:31:23','2019-03-29 20:31:23',NULL,73),(2405,'1903150310','올리버 원터치텐트 (26016995)',29800,2500,298,'여름휴가 필수 아이템 원터치 텐트! \n언제 어디서나 한번에! 펼쳐지고~ 쉽게 접을 수 있어 정말 유용해요!\n가방에 쏙 넣어서 올 여름 힐링여행 떠나봐요!','2019-03-29 20:31:23','2019-03-29 20:31:23',NULL,45),(2406,'1903190362','아크릴 주차알림판 (하늘색) (53009041)',1500,2500,15,'숫자칩을 끼워 간편하게 사용하는 \n아크릴 주차알림판을 소개합니다.\n\n산뜻한 블루톤의 디자인과\n큐방 장착 방식으로 쉽게 탈부착 할 수있어요.\n\n간편하게 숫자칩을 빼고 끼울 수 있어\n전화번호 변경시에도 재구성하여 사용 할수 있어요.\n\n심플하고 편리한 아크릴 주차알림판과 함께 \n즐거운 하루 보내세요!\n','2019-03-29 20:31:23','2019-03-29 20:31:23',NULL,58),(2407,'1903150318','보스 원터치텐트 (26016996)',29800,2500,298,'여름휴가 필수 아이템 원터치 텐트! \n언제 어디서나 한번에! 펼쳐지고~ 쉽게 접을 수 있어 정말 유용해요!\n가방에 쏙 넣어서 올 여름 힐링여행 떠나봐요!','2019-03-29 20:31:23','2019-03-29 20:31:23',NULL,45),(2408,'1902130833','스티커 러기지 죠습니다 (04009420)',1000,2500,10,'워터프루프 재질로 되어 있는 러기지 스티커입니다. \n귀여운 보스 캐릭터 스티커를 캐리어에 붙여 나만의 개성을 나타낼 수 있고, 눈에 잘 띄어 수화물을 찾을 때도 좋아요!\n종이스티커가 아니기 때문에 텀블러나 학용품 등에 붙여도 걱정 없이 사용할 수 있어요.\n','2019-03-29 20:31:23','2019-03-29 20:31:23',NULL,45),(2409,'1901310573','스티커 오토아이렌 사각 주차번호 (04009386)',1500,2500,15,'주차할 때는 전화번호를 남겨두는 센스! 오토 사각 주차번호 스티커로 간편하게 전화번호를 남겨두세요.\n함께 들어있는 숫자 스티커를 조합하여 전화번호를 붙여보세요. 네모칸에 맞춰서 붙이면 깔끔합니다.\n귀여운 오토와 아이렌이 포인트! 앞 유리에 붙여주면 정말 귀여워요. 간단히 붙일 수 있어 편하고 실용적인 주차번호 스티커입니다.\n','2019-03-29 20:31:23','2019-03-29 20:31:23',NULL,58),(2410,'1901310674','캐리어 실버 20인치 (29003526)',49900,2500,499,'여행용 캐리어 20인치 실버색상입니다.\n모던한 색상으로 더욱 멋스럽게 사용하실 수 있습니다.\n캐리어 우측에 비밀번호 잠금장치가 있어 안심하고 사용하실 수 있습니다.\n캐리어를 간단하게 들 수 있는 손잡이와 높이 조절이 가능한 손잡이가 있습니다.\n캐리어 내부에는 물건을 안전하게 고정할 수 있는 버클이 있습니다.','2019-03-29 20:31:23','2019-03-29 20:31:23',NULL,73),(2411,'1901220227','캐리어 보스 24인치 (29003525)',69000,2500,690,'귀여운 갈라파고스 프렌즈 보스와 함께 여행을 떠나요!\n갈라파고스 프렌즈의 보스 캐릭어는 해맑은 보스의 표정과 화사한 색감이 돋보이는 24인치 캐리어입니다. \n앞, 뒷면이 다른 그래픽으로 디자인되어 유니크함을 더했습니다.\n수납공간이 넓은 내부입니다. 소지품을 고정시켜주는 X자형 밴드,작은 사이즈 소지품을 넣을 수 있는 미니 포켓,소지품을 한눈에 쉽게 찾을수 있는 매쉬포켓이 있습니다.\n상단에 튼튼한 손잡이와 길이조절이 가능한 손잡이가 달려 있습니다.\n튼튼한 스틸소재의 길이조절이 가능한 손잡이입니다.\n2개의 지퍼가 달려 있어 여닫을때 매우 편리합니다.\n안전한 잠금장치가 달려 있습니다.','2019-03-29 20:31:23','2019-03-29 20:31:23',NULL,73),(2412,'1901240255','여행용키트 핑크하트 (25013472)',2900,2500,29,'4개의 용기가 들어있는 여행용키트입니다.\n2가지 종류의 용기가 2개씩 들어있어 여행갈 때 로션, 크림 등을 소분하기 좋습니다.\n크림용기에는 크림 뿐 아니라 작은 소품이나 악세사리를 손쉽게 보관할 수 있답니다.\n스파출러가 있어 더욱 편리하고 위생적으로 사용이 가능해요.\n','2019-03-29 20:31:23','2019-03-29 20:31:23',NULL,45),(2413,'1902130801','스티커 러기지 나좀챙겨 (04009424)',1000,2500,10,'워터프루프 재질로 되어 있는 러기지 스티커입니다. \n재밌는 문구가 적힌 스티커를 캐리어에 붙여 나만의 개성을 나타낼 수 있고, 눈에 잘 띄어 수화물을 찾을 때도 좋아요!\n종이스티커가 아니기 때문에 텀블러나 학용품 등에 붙여도 걱정 없이 사용할 수 있어요.\n','2019-03-29 20:31:23','2019-03-29 20:31:23',NULL,45),(2414,'1812260433','여권케이스 네이비폴라베어 (28002470)',7900,2500,79,'네이비색상의 귀여운 폴라베어가 그려진 여권케이스 입니다.\n오른쪽 지퍼에는 동전이나 지폐 소지품을 넣어 사용하고 왼쪽에는 보딩패스,티켓, 카드를 끼워 사용가능합니다\n펼친면 안쪽에는 스웨이드 원단을 사용해 부드럽고 세련된느낌을 줍니다.\n귀여운 폴라베어 여권케이스와 즐거운 여행 하세요!','2019-03-29 20:31:44','2019-03-29 20:31:44',NULL,74),(2415,'1812240390','수면안대 GOODNIGHT (34009519)',3500,2500,35,'별이 가득한  GOOD NIGHT 수면안대를 소개합니다.\n잠을 자는 순간에도 나만의 스타일을 놓치지 마세요.\n코 부분에 덮개 역할을 하는 원단을 덧대어 아래로부터 \n빛이 새어 들어오는 것을 막아줍니다.\n끈 길이를 조절할 수 있어 자신의 사이즈에 맞게 착용할 수 있습니다.\n수면안대 테두리가 깔끔하게 정리되어 있어 얼굴에 닿아도 불편하지 않습니다.','2019-03-29 20:31:44','2019-03-29 20:31:44',NULL,45),(2416,'1812040701','수국 차량용 디퓨저_8ml 체리블러썸 (20008714)',7500,2500,75,'향긋한 체리블러썸향의 차량용 디퓨저를 소개할게요~\n체리블로썸 향기는 발랄하면서 상큼한 오렌지와 그린노트,\n깨끗한 머스크의 조합이 소녀의 수준은 미소를 연상시키는 향이에요.\n수국이 한잎 한잎 들어가 있어 로맨틱한 분위기를 연출할 수 있어요.\n수국 차량용 디퓨저와 함께 향기로운 운전되세요!\n','2019-03-29 20:31:44','2019-03-29 20:31:44',NULL,58),(2417,'1810220102','타포린가방 민트이모지 (대) (07004168)',4800,2500,48,'상큼한 민트 바탕에 귀여운 이모지 그래픽이 가득한 대형 타포린 부직포 가방입니다.\n대형 사이즈로 캠핑이나 여행갈 때, 마트에서 쇼핑할 때 장바구니로 유용하게 쓸 수 있어요.  \n종이가방보다 내구성이 좋고 방수가 되는 타포린 재질이라 여러번 사용할 수 있습니다.\n또한 손잡이가 평직 웨빙끈으로 만들어져 튼튼합니다. 쓰지 않을때는 간편하게 접어서 휴대할 수 있어요.\n용도에 맞게 다양하게 사용해 보세요.','2019-03-29 20:31:44','2019-03-29 20:31:44',NULL,73),(2418,'1809280235','타포린 보조가방 핑크 오토 (소) (07004134)',1800,2500,18,'사랑스러운 오토 패턴의 부직포 보조가방입니다. \n달콤한 핑크 컬러와 보라색 손잡이 조합이 귀여운 가방이에요.\n종이가방보다 내구성이 좋은 부직포 재질이라서 여러번 재사용 가능합니다.\nA4용지보다 조금 작은 사이즈로, 간편하게 들고다닐 수 있어요.\n귀여운 디자인의 타포린백에 선물을 담아 전달하는 것도 좋아요! \n도시락 가방으로 활용하거나, 신발 주머니, 준비물 가방 등 다양하게 사용해보세요~','2019-03-29 20:31:44','2019-03-29 20:31:44',NULL,73),(2419,'1811080145','스프링 돔송 러기지택_바비숑 (25013639)',3800,2500,38,'카드케이스로 사용할 수 있는 러기지택입니다. 길게 늘어나는 스프링 와이어 고리가 들어 있어\n백팩이나 캐리어 등 어디에나 자유롭게 걸 수 있습니다.귀여운 바비숑 캐릭터가 인쇄되어 있어 귀여움을 자아냅니다.\n 뒷면에는 포켓이 있어 네임택이나 교통카드를 넣을 수 있습니다.\n','2019-03-29 20:31:44','2019-03-29 20:31:44',NULL,74),(2420,'1809100299','목쿠션 그레이시바 메모리폼 (34009471)',8900,2500,89,'대세 캐릭터!! 귀여운 시바견 목쿠션입니다.\n메모리폼 목쿠션이라서 더욱 폭신폭신하답니다.\n여행갈 때, 이동할 때 손쉽게 이용할 수 있는 목쿠션입니다.\n지퍼가 달려있어서 세탁시 내용물을 빼서 청결하고 간편하게 세탁할 수 있습니다.','2019-03-29 20:31:44','2019-03-29 20:31:44',NULL,45),(2421,'1810080067','목쿠션 발그레핑크토끼 (34009358)',7900,2500,79,'핑크 색상의 귀가포인트인 귀여운 토끼 디자인 목쿠션 입니다.\n기내에서나 장시간 업무, 야근 시 편안한 베게로 가능합니다.\n잠시 휴식이 필요할경우 꿀잠을 돕는 베스트 아이템이랍니다\n충전재가 푹신하게 들어있어 착용시 목이 편안합니다.\n','2019-03-29 20:31:44','2019-03-29 20:31:44',NULL,45),(2422,'1812260350','캐리어벨트 블랙 이모지 일반 (34009623)',4500,2500,45,'감각적인 이모지 패턴이 그려져있는 캐리어벨트입니다. \n최대길이 180cm로 다양한 사이즈의 캐리어에 사용할 수 있습니다.\n다른 러기지와 함께 있을 경우, 개인의 러기지를 쉽게 식별할 수 있습니다.\n여행중 러기지가 충격으로 열리는 것을 방지합니다.\n간단히 열고 닫을 수 있어 어디에서든 편리하게 사용할 수 있습니다.\n개인의 러기지를 취향에 맞춰 특별하게 꾸밀 수 있습니다.','2019-03-29 20:31:45','2019-03-29 20:31:45',NULL,45),(2423,'1812040700','수국 차량용 디퓨저_13ml 아르페쥬 (20008715)',7800,2500,78,'향기로운 에르페쥬향의 차량용 디퓨저를 소개할게요~\n에르페쥬 향기는 상큼한 레몬과 달콤한 복숭아향의 시작으로 \n향긋하고 은은한 꽃향기가 어우러진 사랑스러운 향이에요.\n수국이 한잎 한잎 들어가 있어 로맨틱한 분위기를 연출할 수 있어요.\n수국 차량용 디퓨저와 함께 향기로운 운전되세요!\n','2019-03-29 20:31:45','2019-03-29 20:31:45',NULL,58),(2424,'1812110182','돗자리 소형 아이렌 핑크 (26016835)',3800,2500,38,'귀여운 아이렌 패턴이 그려진 핑크 돗자리를 소개할게요~\n코팅이 되어 방수에 탁월하고 소형으로 휴대성도 뛰어나요.\n분홍색 돗자리가 피크닉을 더욱 화사하게 만들어 줄 거에요!\n피크닉 매트와 함께 즐거운 피크닉을 즐겨보세요.\n','2019-03-29 20:31:45','2019-03-29 20:31:45',NULL,45),(2425,'1811080139','스프링 돔송 러기지택_블루갈라파고스 (25013638)',3800,2500,38,'카드케이스로 사용할 수 있는 러기지택입니다. 길게 늘어나는 스프링 와이어 고리가 들어 있어\n백팩이나 캐리어 등 어디에나 자유롭게 걸 수 있습니다.귀여운 갈라파고스 프렌즈가 인쇄되어 있어 귀여움을 자아냅니다. \n뒷면에는 포켓이 있어 네임택이나 교통카드를 