NULL,81),(2577,'1810100314','겔비즈 아이마스크 블루 (26015822)',5800,2500,58,'눈의 피로&붓기를 없애주는 겔비즈 아이마스크를 소개합니다.\n귀여운 고양이 모양의 겔비즈 아이마스크는 차갑게 혹은 뜨겁게 두 가지 방법으로 사용할 수 있어요.\n눈이 부었을 때, 열이 오를때, 휴식을 취할 때 등 필요에 따라 편리하게 사용해 보세요.\n겔 비즈 마스크와 함께 붓기 쏙쏙!\n기분 좋은 하루 보내세요.','2019-03-29 20:33:15','2019-03-29 20:33:15',NULL,76),(2578,'1812270337','쿨링 하트아이마스크_아이좋아 (26015644)',2000,2500,20,'지친 눈을 쉬게해주는 아이마스크를 소개할게요!\n따뜻하게 또는 차갑게 사용이 가능하답니다.\n눈이 부었을때, 열이날 때, 휴식이 필요할 때 등 다양하게 사용하세요!\n','2019-03-29 20:33:15','2019-03-29 20:33:15',NULL,78),(2579,'1902150020','안마봉 아이렌 (34009640)',9900,2500,99,'밝은 노란색의 귀여운 아이렌 안마봉입니다.\n학교나,회사, 집 언제 어디서나 결리고 아픈곳을 두드려주면 부드럽게\n긴장을 풀어주는 시원한 안마봉입니다.\n손잡이부분에는 부드러운 원단이 감겨져있어 그립감이좋습니다.\n아래에는 지압봉으로 쓸 수 있도록 둥글게 되어있어 실용적으로 사용가능합니다.\n','2019-03-29 20:33:15','2019-03-29 20:33:15',NULL,81),(2580,'1811081086','레인보우 헤드 마사져 (핑크) (53008603)',1800,2500,18,'찌릿찌릿! 시원~\n시원한 머리 마사지기를 소개해요!\n\n특이하게 생겼지만, 사용 방법은 굉장히 간단해요.\n마사지를 원하는 머리부분에 마사기기를 위치시킨 후, \n마사지기에 있는 작은 돌기를 자유롭게 위아래로 움직이며 자극해주세요~\n찌릿찌릿하면서도 시원해지는 기분을 느끼실 수가 있어요!\n\n업무때문에 힘들 때, 사무실에서 피곤으로 인해 잠이 쏟아질 때!\n머리 마사지기로 오분 정도씩 마사지해주세요~\n스트레스도 사라지고 기분이 좋아질거에요!\n\n머리마사지기로 저렴하게 기분전환하세요!\n','2019-03-29 20:33:15','2019-03-29 20:33:15',NULL,76),(2581,'1810100319','겔비즈 아이마스크 보스 (26016075)',5800,2500,58,'눈의 피로&붓기를 없애주는 겔비즈 아이마스크를 소개합니다.\n귀여운 보스 모양의 겔비즈 아이마스크는 차갑게 혹은 뜨겁게 두 가지 방법으로 사용할 수 있어요.\n눈이 부었을 때, 열이 오를때, 휴식을 취할 때 등 필요에 따라 편리하게 사용해 보세요.\n겔 비즈 마스크와 함께 붓기 쏙쏙!\n기분 좋은 하루 보내세요.','2019-03-29 20:33:15','2019-03-29 20:33:15',NULL,76),(2582,'1810100301','겔비즈 아이마스크 핑크 (26015821)',5800,2500,58,'눈의 피로&붓기를 없애주는 겔비즈 아이마스크를 소개합니다.\n귀여운 토끼 모양의 겔비즈 아이마스크는 차갑게 혹은 뜨겁게 두 가지 방법으로 사용할 수 있어요.\n눈이 부었을 때, 열이 오를때, 휴식을 취할 때 등 필요에 따라 편리하게 사용해 보세요.\n겔 비즈 마스크와 함께 붓기 쏙쏙! \n기분 좋은 하루 보내세요.','2019-03-29 20:33:15','2019-03-29 20:33:15',NULL,76),(2583,'1804190140','사각 손거울 이모지패턴 블랙(12001557)',2900,2500,29,'휴대용 양면손거울로 파우치에 쏙 들어가는 사이즈입니다.\n일반거울&2배 확대경으로 구성되어 있습니다.','2019-03-29 20:33:38','2019-03-29 20:33:38',NULL,76),(2584,'1808220185','브러쉬클렌징볼(62000481)',3800,2500,38,'세척과 건조를 동시에 할 수 있